{"url": "https://www.imdb.com/title/tt0039416/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0039416/", "name": "Gentleman&apos;s Agreement", "image": "https://m.media-amazon.com/images/M/MV5BMTZhYWIxNmMtYzE2OS00YzljLWI2YTQtZTE0NDU5ZDQwZTc0L2ltYWdlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_.jpg", "description": "A reporter pretends to be Jewish in order to cover a story on anti-Semitism, and personally discovers the true depths of bigotry and hatred.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0039416/"}, "author": {"@type": "Person", "name": "Okonh0wp"}, "dateCreated": "2004-03-16", "inLanguage": "English", "name": "It&apos;s simultaneously a classic and a bad picture", "reviewBody": "On the one hand, Gentleman&apos;s Agreement has a highly enlightened prejudice, even today, let alone 1947. Gregory Peck plays a journalist who decides to pretend to be Jewish so he can attain a real-life perspective on anti-semitism. Peck&apos;s transformation from a determined writer looking for an edge to a crusader against prejudice is nothing short of profound. The twist of course is that Peck gets lost in the assignment, starts seeing himself as a Jew and struggles to maintain his composure amid all the anti-semitism he experiences.      Considering that, it&apos;s a shame that the film&apos;s abilities to tell a story lag so far behind the movie&apos;s depth and boldness. There&apos;s a lot of emphasis on the romance between Peck and his editor&apos;s niece, which is pretty overdone for a pair who has as little chemistry as McGuire and Peck. I think the worst part of that is hearing Gregory Peck referring to McGuire&apos;s character as &quot;my girl&quot; like he&apos;s in middle school, especially considering I&apos;ve always associated Peck with characters of tremendous maturity. Additional randomness comes from the fact that the film also focuses on Peck&apos;s relationship with his ailing mother, which doesn&apos;t have much to do with the central plot at all. What seemed to be an attempt to give a more well-rounded view of the character, the story felt bogged down by those elements.      Still, a worthwhile movie, overall, *** out of ****", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 6}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 16339, "bestRating": 10, "worstRating": 1, "ratingValue": 7.2}, "contentRating": "Not Rated", "genre": ["Drama", "Romance"], "keywords": "new york city,single father,bigotry,prejudice,jew", "trailer": {"@type": "VideoObject", "name": "Trailer", "embedUrl": "/video/imdb/vi1014677273", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BZTVmNzNhZDAtMDM1Mi00NmYzLWExZDAtNzU3MTQzZDY0ZWU1XkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BZTVmNzNhZDAtMDM1Mi00NmYzLWExZDAtNzU3MTQzZDY0ZWU1XkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg", "description": ""}, "actor": [{"@type": "Person", "url": "/name/nm0000060/", "name": "Gregory Peck"}, {"@type": "Person", "url": "/name/nm0570192/", "name": "Dorothy McGuire"}, {"@type": "Person", "url": "/name/nm0002092/", "name": "John Garfield"}], "director": [{"@type": "Person", "url": "/name/nm0001415/", "name": "Elia Kazan"}], "creator": [{"@type": "Organization", "url": "/company/co0000756/"}, {"@type": "Person", "url": "/name/nm0387740/", "name": "Laura Z. Hobson"}, {"@type": "Person", "url": "/name/nm0366454/", "name": "Moss Hart"}, {"@type": "Person", "url": "/name/nm0001415/", "name": "Elia Kazan"}], "duration": "PT1H58M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0039416/"], ["og:site_name", "IMDb"], ["og:title", "Gentleman's Agreement (1947) - IMDb"], ["og:description", "Gentleman's Agreement: Directed by Elia Kazan. With Gregory Peck, Dorothy McGuire