{"url": "https://www.imdb.com/title/tt0071007/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0071007/", "name": "Little House on the Prairie", "image": "https://m.media-amazon.com/images/M/MV5BMTg0NzQ4MDAtYmNlYi00OGExLWE3YjItNzEyOWI3MGE3NzRkXkEyXkFqcGdeQXVyMzU3MTc5OTE@._V1_.jpg", "description": "The life and adventures of the Ingalls family in the nineteenth century American Midwest.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0071007/"}, "author": {"@type": "Person", "name": "actorsmama"}, "dateCreated": "2003-07-04", "inLanguage": "English", "name": "This was an inspiring series", "reviewBody": "I&apos;ve also read the negative comments and I have none.  I&apos;ve noticed some of the things that were mentioned but so what?  What&apos;s wrong with showing emotion and crying?  What&apos;s the problem with bringing new characters on for just one episode?  That&apos;s the way shows are done, which should be obvious to all adults by now - if they&apos;ve watched at least, well.....*anything* in film.  I&apos;ve been part of filming many times and I can tell you honestly that Michael Landon would have been a dream to work with.  Melissa Gilbert is a pro and I absolutely adore her work. She remains one of my favorite actors to this day.  The rest of the players are priceless.  I&apos;m 41 now and I was growing up watching this show and I just wonder how in the world could a parent NOT want their child to watch something like that?  I learned so much from the storylines, and they taught me the meaning of goodness and purity. Little House was the epitome of good.  They brought to light many situations and the best solutions to them and in most cases no one was ever hurt(unless an emotional learning experience).  And not even Jack drowned. :o)  If you want a wholesome show that the family will love and will benefit from, this is it.  Not even the Waltons can top this one, and I love that show. Overlook the discrepancies that were mentioned here and you won&apos;t be sorry you took the chance.  I came here to post because I saw that the first season of Little House is coming out and I would love for others to benefit. I just wish they&apos;d filmed it in the past 5 years so my son could&apos;ve been part of it. :o)"}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 22969, "bestRating": 10, "worstRating": 1, "ratingValue": 7.5}, "contentRating": "TV-PG", "genre": ["Drama", "Family", "Romance"], "datePublished": "1974-03-30", "keywords": "1880s,1870s,brood,prairie skirt,pigtails", "actor": [{"@type": "Person", "url": "/name/nm0001271/", "name": "Melissa Gilbert"}, {"@type": "Person", "url": "/name/nm0001446/", "name": "Michael Landon"}, {"@type": "Person", "url": "/name/nm0002111/", "name": "Karen Grassle"}], "creator": [{"@type": "Organization", "url": "/company/co0051222/"}, {"@type": "Organization", "url": "/company/co0072315/"}, {"@type": "Person", "url": "/name/nm0359256/", "name": "Blanche Hanalis"}], "trailer": {"@type": "VideoObject", "name": "Series Trailer", "embedUrl": "/video/imdb/vi3131882009", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BZDczMDcxNjktZjFmMi00MzQ1LWEzYTYtNWM2MmUxNTRlNjFmXkEyXkFqcGdeQXRodW1ibmFpbC1pbml0aWFsaXplcg@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BZDczMDcxNjktZjFmMi00MzQ1LWEzYTYtNWM2MmUxNTRlNjFmXkEyXkFqcGdeQXRodW1ibmFpbC1pbml0aWFsaXplcg@@._V1_.jpg", "description": ""}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0071007/"], ["og:site_name", "IMDb"], ["og:title", "Little House on the Prairie (TV Series 1974\u20131983) - IMDb"], ["og:description", "Little House on the Prairie: Created by Blanche Hanalis. With Melissa Gilbert, Michael Landon, Karen Grassle, Rachel Lindsay Greenbush. The life and adventures of the Ingalls family in the nineteenth century American Midwest."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTg0NzQ4MDAtYmNlYi00OGExLWE3YjItNzEyOWI3MGE3NzRkXkEyXkFqcGdeQXVyMzU3MTc5OTE@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1470.5882352941178"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt9100054/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt9100054/", "name": "The Lost Daughter", "image": "https://m.media-amazon.com/images/M/MV5BZTJmYTJmYTktMzU1Yy00ZTZlLTgzNjItYmY4ZDFjZGFjYjZhXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_.jpg", "description": "A woman&apos;s beach vacation takes a dark turn when she begins to confront the troubles of her past.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt9100054/"}, "author": {"@type": "Person", "name": "tm-sheehan"}, "dateCreated": "2021-12-31", "inLanguage": "English", "name": "Not impressed- good acting though in boring film", "reviewBody": "My Review - The Lost Daughter Netflix\n\nMy Rating 5/10 As readers of this page know I&apos;m a great advocate for Women Directors also a great fan of Maggie Gyllenhaal and Olivia Coleman but this film directorial debut from Maggie Gyllenhaal left me totally unimpressed.\n\nI kept thinking would I have liked it more on a Cinema screen instead of a television screen and at the conclusion I had decided no I just didn&apos;t get it.\n\nThe film has been highly praised by some critics especially for Maggie Gyllenhaal &apos;S directing and Screenplay writing.\n\nOlivia Coleman&apos;s performance as Leda is certainly a consideration for an Oscar nomination next year.\n\nThe Lost Daughter is about a woman Leda Caruso who while on a summer holiday, finds herself becoming obsessed with another woman and her daughter on the beach . Their interactions provoke memories of her own early motherhood to come back and unravel her holiday bliss.\n\nThe two women who portray Leda are Olivia Colman as Leda Caruso on holiday on the Italian Coast and Jessie Buckley as young the Leda Caruso in flashback . Both actresses give impressive performances but both characters annoyed me and I just lost interest in them and their story.\n\nDakota Jackson is impressive as the young mother Nina who Leda notices on the resort beach with her daughter and obviously sees a mirror image of her life experiences through their interactions which disturb her and are reflected in this 2 hour movie.\n\nThe two men in this film Ed Harris as Lyle a resort employee and young Will played by Paul Mescal are interesting characters that never really develop . This film I truly fits a genre description I usually never refer to as &quot; A Woman&apos;s Picture &quot; that&apos;s certainly not an insult but it&apos;s a Woman&apos;s Picture that didn&apos;t entertain me or move me at all.\n\nWhy that happened I can&apos;t say as it would contain spoilers I&apos;ll just say in my opinion both Leda&apos;s were two unlikeable characters that I had no empathy with at all.\n\nMature Leda obviously guilt ridden and depressed about her life choices involving her daughters and young Leda headstrong and following her desires rather than her responsibilities.\n\nI won&apos;t spend more effort on this review as the film just failed to impress me I know it will appeal to some movie goers but apart from the good performances by the cast the story just didn&apos;t move me and the Direction by Maggie Gyllenhaal makes me hope that she won&apos;t give up acting.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 5}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 58443, "bestRating": 10, "worstRating": 1, "ratingValue": 6.7}, "contentRating": "R", "genre": ["Drama"], "datePublished": "2021-12-31", "keywords": "mother daughter relationship,unruly child,female nudity,daughter walks in on mother masturbating,parent", "trailer": {"@type": "VideoObject", "name": "Official Trailer", "embedUrl": "/video/imdb/vi243516185", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BOGY0MzcxZmItNDAzMC00OGUyLTkxYmEtODJlYTE1OWY1NjU2XkEyXkFqcGdeQWpnYW1i._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/image