{"url": "https://www.imdb.com/title/tt0099225/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0099225/", "name": "Caroline?", "image": "https://m.media-amazon.com/images/M/MV5BMTEwMjczOTI0MzNeQTJeQWpwZ15BbWU2MDA3MzczOQ@@._V1_.jpg", "description": "A mysterious woman claiming to be the deceased daughter of a rich man tries to solve the problems of his untrusting son and supposedly mentally handicaped daughter. But one question stands in her way: is she really Caroline?", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0099225/"}, "author": {"@type": "Person", "name": "engle_james"}, "dateCreated": "2010-01-06", "inLanguage": "English", "name": "One of the best television movies ever", "reviewBody": "Truly remarkable on so many levels, and worth repeated viewings because it&apos;s easy to miss some things the first time around. For example, notice who is in the background when Caroline&apos;s father laments &quot;I don&apos;t even know my own daughter,&quot; or the book the adult Winston picks up when speaking to Hilary. The acting is exceptional all around, but especially by Shawn Phelan as young Winston and Jenny Jacobs as Heidi- yes, Jenny Jacobs really does have a disability in real life, and I wouldn&apos;t be surprised if the woman who played Hilary also does, as well. Stephanie Zimbalist is luminous as Caroline, and the scenes between her and Patricia Neal (as the headmistress who doesn&apos;t believe she&apos;s really Caroline) virtually crackle with tension. The ending always puts a lump in my throat, but this is a rare movie that actually earns it&apos;s tears. It originally aired on CBS against the Jim Bakker story, which all the critics thought would destroy Caroline in the ratings, but it was the other way around! I&apos;ve read the book as well and while I liked it, the movie in my opinion is better, because the actors bring the characters to life in a way that the written word can&apos;t.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 463, "bestRating": 10, "worstRating": 1, "ratingValue": 7.2}, "contentRating": "PG", "genre": ["Drama"], "datePublished": "1990-04-29", "keywords": "airplane crash,impostor,flashback,dysfunctional family,assumed dead", "actor": [{"@type": "Person", "url": "/name/nm0000258/", "name": "Stephanie Zimbalist"}, {"@type": "Person", "url": "/name/nm0715622/", "name": "Pamela Reed"}, {"@type": "Person", "url": "/name/nm0342732/", "name": "George Grizzard"}], "director": [{"@type": "Person", "url": "/name/nm0765121/", "name": "Joseph Sargent"}], "creator": [{"@type": "Organization", "url": "/company/co0078555/"}, {"@type": "Person", "url": "/name/nm0465125/", "name": "E.L. Konigsburg"}, {"@type": "Person", "url": "/name/nm0208775/", "name": "Michael De Guzman"}], "duration": "PT1H40M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0099225/"], ["og:site_name", "IMDb"], ["og:title", "Caroline? (TV Movie 1990) - IMDb"], ["og:description", "Caroline?: Directed by Joseph Sargent. With Stephanie Zimbalist, Pamela Reed, George Grizzard, Patricia Neal. A mysterious woman claiming to be the deceased daughter of a rich man tries to solve the problems of his untrusting son and supposedly mentally handicaped daughter. But one question stands in her way: is she really Caroline?"], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTEwMjczOTI0MzNeQTJeQWpwZ15BbWU2MDA3MzczOQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1831.5018315018315"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alte