{"url": "https://www.imdb.com/title/tt0046587/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0046587/", "name": "Climax!", "image": "https://m.media-amazon.com/images/M/MV5BMzVkZDVkYTMtYmQ2Mi00YTM1LWI3YTYtYTY2MDgwOTZjNGJjXkEyXkFqcGdeQXVyMzYyNjE5NDY@._V1_.jpg", "description": "This was an anthology series that presented a different story and different set of characters on each episode. It ran from 1954 to 1958 and featured Casino Royale of James Bond fame, which led to two theatrical movies of the same ...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0046587/"}, "author": {"@type": "Person", "name": "J.Bond"}, "dateCreated": "1999-01-31", "inLanguage": "English", "name": "Casino Royale - 1954", "reviewBody": "Being a Bond fan, procuring the video of this original broadcast was neither an easy feat nor overlooked in its importance.  The October 21, 1954 episode of &quot;Climax!&quot; was the first time James Bond appeared on-screen, and nearly half a century later Bond is still making movies.\n\nThe &quot;live&quot; quality of the show makes it all that much more enjoyable; the spontaneity of the lines spoken and the fact that the actors are working with an actual time limit makes for a show in which the flow is constant and consistent, the interest is kept to an expected level, and the characters are more realistic.  These are qualities which cannot be replicated in some 20 overly planned and rehearsed later Bond films - but this only makes Casino Royale different - not better.\n\nIt is certainly entertaining, to say the least, to watch the original characterization of &quot;Jimmy&quot; Bond - a fast-talking American agent - and compare it to the amazingly developed cool-headedness of today&apos;s 007.  What a difference 45 years can make!"}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 223, "bestRating": 10, "worstRating": 1, "ratingValue": 6.8}, "genre": ["Drama"], "datePublished": "1954-10-07", "keywords": "timeframe 1950s,exclamation point in title,one word title", "actor": [{"@type": "Person", "url": "/name/nm0526485/", "name": "William Lundigan"}, {"@type": "Person", "url": "/name/nm0319497/", "name": "Art Gilmore"}, {"@type": "Person", "url": "/name/nm0182250/", "name": "Mary Costa"}], "creator": [{"@type": "Organization", "url": "/company/co0684033/"}]}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0046587/"], ["og:site_name", "IMDb"], ["og:title", "Climax! (TV Series 1954\u20131958) - IMDb"], ["og:description", "Climax!: With William Lundigan, Art Gilmore, Mary Costa, Michael Rennie. This was an anthology series that presented a different story and different set of characters on each episode. It ran from 1954 to 1958 and featured Casino Royale of James Bond fame, which led to two theatrical movies of the same name."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMzVkZDVkYTMtYmQ2Mi00YTM1LWI3YTYtYTY2MDgwOTZjNGJjXkEyXkFqcGdeQXVyMzYyNjE5NDY@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1417.1974522292994"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt0074048/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0074048/", "name": "Rich Man, Poor Man", "image": "https://m.media-amazon.com/images/M/MV5BMTQ5Nzk4Mzc3N15BMl5BanBnXkFtZTcwMTg5NDUxMQ@@._V1_.jpg", "description": "An examination of the trials and tribulations of the Jordache family, from the period following World War II to the late 1960s.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0074048/"}, "author": {"@type": "Person", "name": "CosmicDwellings"}, "dateCreated": "2001-01-02", "inLanguage": "English", "name": "The first and one of the few best!", "reviewBody": "The first ever television mini-series was broadcast as 12 x 50 minute episodes in the U.K., either side of &apos;News At Ten&apos; on three consecutive Wednesday and Friday nights throughout July, in that summer, of 1976. It was ITV&apos;s answer to the BBC&apos;s coverage of the Olympics at the time-and what an answer!\n\nThe story of Rudy &amp; Tom Jordache...two brothers who battled through their conflicting lifestyles in two different ways. Based on the best-selling novel by Irwin Shaw, we are taken on a roller-coaster ride starting in Port Philip, New York in 1945 through to the French Riviera in the mid-60&apos;s. A classic tale of Rags to Riches and Happiness to Heartbreak.\n\nMessrs. Strauss and Nolte are awesome as the brothers with the fine support of Susan Blakely as the love interest in the story. All this interjected with a great well known cast, a legend of the TV Screens was born.\n\nThe series won countless Emmy nominations and came away with Four in total in the form of Edward Asner, Fionnuala Flanagan, composer Alex North and director, David Greene.\n\nDon&apos;t miss this one!", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 3074, "bestRati