{"url": "https://www.imdb.com/title/tt0099980/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0099980/", "name": "The Last Best Year", "image": "https://m.media-amazon.com/images/M/MV5BMTY5MzMwNDI3M15BMl5BanBnXkFtZTcwOTkwNzYxMQ@@._V1_.jpg", "description": "Returning from a business trip abroad, Jane (Bernadette Peters) has a dizzy spell while at home. As her condition does not improve, she consults a doctor who finds that she is very ill and that she has no family to help her throug...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0099980/"}, "author": {"@type": "Person", "name": "sorajen"}, "dateCreated": "2000-08-03", "inLanguage": "English", "name": "thought provoking", "reviewBody": "I found this movie quite by accident and from the very beginning was enthralled.  Bernadette Peters portrayal of a woman dying of cancer was thought provoking.  It made me think of my own reaction to life and death, and the relationships that bind us together.  The friendship she had with Mary Tyler Moore&apos;s character is one I wish I had myself.  I will watch this movie again and again and enjoy it&apos;s simplicity every time.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 113, "bestRating": 10, "worstRating": 1, "ratingValue": 6.3}, "contentRating": "PG", "genre": ["Drama"], "datePublished": "1990-11-04", "keywords": "kansas city missouri,chicago illinois,mother gives child up for adoption,the last hurrah,moral support", "actor": [{"@type": "Person", "url": "/name/nm0001546/", "name": "Mary Tyler Moore"}, {"@type": "Person", "url": "/name/nm0001613/", "name": "Bernadette Peters"}, {"@type": "Person", "url": "/name/nm0066028/", "name": "Brian Bedford"}], "director": [{"@type": "Person", "url": "/name/nm0259589/", "name": "John Erman"}], "creator": [{"@type": "Organization", "url": "/company/co0231840/"}, {"@type": "Organization", "url": "/company/co0063285/"}, {"@type": "Person", "url": "/name/nm0725766/", "name": "David W. Rintels"}], "duration": "PT1H36M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0099980/"], ["og:site_name", "IMDb"], ["og:title", "The Last Best Year (TV Movie 1990) - IMDb"], ["og:description", "The Last Best Year: Directed by John Erman. With Mary Tyler Moore, Bernadette Peters, Brian Bedford, Carmen Mathews. Returning from a business trip abroad, Jane (Bernadette Peters) has a dizzy spell while at home. As her condition does not improve, she consults a doctor who finds that she is very ill and that she has no family to help her through this very trying time. He enlists the help of a therapist (Mary Tyler Moore) who is very hesitant to become involved in this case due to the loss she suffered as a young child. As her condition deteriorates, Jane learns how to come to terms with her past as does her therapist."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTY5MzMwNDI3M15BMl5BanBnXkFtZTcwOTkwNzYxMQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1862.7450980392157"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
