{"url": "https://www.imdb.com/title/tt0042168/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0042168/", "name": "What&apos;s My Line?", "image": "https://m.media-amazon.com/images/M/MV5BNGQ2MDM0NWEtOGQ1YS00NzVkLTgyOTUtMjM5Njk4ZWZlY2MzXkEyXkFqcGdeQXVyMjQzOTk0NzU@._V1_.jpg", "description": "Four panelists must determine guests&apos; occupations - and, in the case of famous guests, while blindfolded, their identity - by asking only &quot;yes&quot; or &quot;no&quot; questions.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0042168/"}, "author": {"@type": "Person", "name": "timetraxer"}, "dateCreated": "2003-01-26", "inLanguage": "English", "name": "This is my favorite game show...enjoyed as a child and more so as an adult!", "reviewBody": "I watched &quot;What&apos;s My Line&quot; as a child and am grateful for the chance to see the series again as part of the Game Show Network&apos;s current lineup (as of January 2003).  This particular show is wonderful in all it&apos;s incarnations, though I really enjoy the &quot;early years&quot; from 1951 thru 1967.  Besides the fun of guessing the contestants&apos; occupations, it&apos;s a joy to listen to the humorous banter of the 4 panelists and the host John Charles Daily.  The special guests add an entertaining and historical aspect to the show, as so many of the guests have long since passed away.  Though I like many game shows, &quot;What&apos;s My Line&quot; will long remain my favorite...and one of the reasons I enjoy the late night hours lately!  Check it out before the Game Show Networks revamps their lineup!"}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 1572, "bestRating": 10, "worstRating": 1, "ratingValue": 8.6}, "genre": ["Family", "Game-Show"], "datePublished": "1950-02-02", "keywords": "1950s,1960s,timeframe 1950s,timeframe 1960s,mystery guest", "actor": [{"@type": "Person", "url": "/name/nm019845