{"url": "https://www.imdb.com/title/tt0113678/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0113678/", "name": "The Unspoken Truth", "image": "https://m.media-amazon.com/images/M/MV5BMTQ2Njk3NjEyNl5BMl5BanBnXkFtZTcwMjgxMjkyMQ@@._V1_.jpg", "description": "In this fact-based story, a woman is convinced by her bad-boy husband to take the blame for a crime he committed, and her life is soon thrown into turmoil.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0113678/"}, "author": {"@type": "Person", "name": "musicboater"}, "dateCreated": "2005-08-22", "inLanguage": "English", "name": "Gets by on a good story", "reviewBody": "This film is was made in 1995 as a television drama for a broadcast network. The film is a made-for-TV-movie and thus has all of the elements that make it a mediocre, predictable, well, television movie. The fact that the story is based (and at times the exact same) on true events that occurred to the Hawkins family is the only real reason the film is worthwhile watching.\n\nLea Thompson plays Brianne Hawkins, a woman suffering from mental and physical abuse from her family members, particularly her husband, Clay. The plot builds when she and Clay are found guilty of murder and she helps create a story to keep them out of prison...and the rest is history.\n\nThompson&apos;s acting is above average (for a television film), and her portrayal of Brianne is authentic. In addition, the abusive husband Clay, played by James Marshall (who is normally known for easy-going, kind characters) is also above par. Marshall&apos;s roles are usually hit-and-miss, although this character is performed quite well. The audience identifies with all of the characters and finds sympathy with Brianne and the Cleary family.\n\nPeter Werner, an old expert at television film, shows us nothing new with the film, but gives us the typical melodrama that comes with a TV film. It seems, during certain scenes, that Werner could add more direction to both the cinematography and the acting, as they seem stale and overused at times. Werner does do a good job, however, instilling some underlying themes in the film, and gives the viewer the chance to think about the situation and reflect upon values and morals.\n\nMark Snow&apos;s music is great in its own right, but at times Werner seems as if he doesn&apos;t know when to place it. Overall, however, the jazzy, suspenseful feel Snow gives the audience is acceptable.\n\nI would recommend this film to anyone who has studied the Brianne Hawkins&apos;s case, and to anyone who is a fan of Werner, Thompson, or Marshall. Otherwise, this film shows nothing particularly exciting. The fact the story is true--to a certain extent--makes the film worthwhile, but it&apos;s not something I recommend people rushing to buy or rent. If you&apos;re looking for a two-hour time passer, I&apos;d suggest one give it a shot, but don&apos;t prioritize this film above much else.\n\n6/10"}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 174, "bestRating": 10, "worstRating": 1, "ratingValue": 5.2}, "contentRating": "Not Rated", "genre": ["Drama", "Crime"], "datePublished": "1995-09-24", "keywords": "false confession,criminal trial,courtroom,taking the rap,true crime", "actor": [{"@type": "Person", "url": "/name/nm0000670/", "name": "Lea Thompson"}, {"@type": "Person", "url": "/name/nm0435678/", "name": "Patricia Kalember"}, {"@type": "Person", "url": "/name/nm0000387/", "name": "Robert Englund"}], "director": [{"@type": "Person", "url": "/name/nm0921464/", "name": "Peter Werner"}], "creator": [{"@type": "Organization", "url": "/company/co0046031/"}, {"@type": "Organization", "url": "/company/co0152560/"}, {"@type": "Person", "url": "/name/nm0594195/", "name": "J.A. Mitty"}], "duration": "PT1H45M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0113678/"], ["og:site_name", "IMDb"], ["og:title", "The Unspoken Truth (TV Movie 1995) - IMDb"], ["og:description", "The Unspoken Truth: Directed by Peter Werner. With Lea Thompson, Patricia Kalember, Robert Englund, Dick O'Neill. In this fact-based story, a woman is convinced by her bad-boy husband to take the blame for a crime he committed, and her life is soon thrown into turmoil."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTQ2Njk3NjEyNl5BMl5BanBnXkFtZTcwMjgxMjkyMQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1412.4293785310736"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
