{"url": "https://www.imdb.com/title/tt0083428/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0083428/", "name": "Herbie, the Love Bug", "image": "https://m.media-amazon.com/images/M/MV5BM2M1NjFkYjktZDJhZS00YjNhLThjZjAtOTFkOGUxNTk3MmZjXkEyXkFqcGdeQXVyNjExODE1MDc@._V1_.jpg", "description": "Jim Douglas and his partner Bo ran a small driving school with a very &quot;human&quot; Volkswagen Beetle named Herbie, who could think for &quot;himself&quot; and frequently got Jim into some sticky comic situations. Jim&apos;s arch-rival was snooty Rand...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0083428/"}, "author": {"@type": "Person", "name": "dwtaxi"}, "dateCreated": "2014-06-11", "inLanguage": "English", "name": "Disney are fools.", "reviewBody": "They actually screened this in Australia prior to the TV Movie coming out, I enjoyed it as a child, can&apos;t remember much of it though, and of course its not available anywhere, legitimate copy or not.\n\nThe &quot;general knowledge&quot; is that Disney canceled the series after only 6 episodes and refuses to let it out of The Vault because its central theme is a divorced woman with children finding happiness with the (in this version) single Jim Douglas. And Disney will not tolerate the idea of divorce, nor support it in any way; doesn&apos;t matter that 1/2 of American marriages fail, divorce is wrong. That&apos;s the word on the street anyway, and its at least an explanation, even if it is a downright stupid one.\n\nAlso, only Herbie Goes Bananas was truly terrible, Herbie Fully Loaded was pretty good if you ignore the general laziness of the production and stupidity of the main characters. Even the TV movie is saved from the trash heap by virtue of Bruce Campbell and his power of being awesome."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 571, "bestRating": 10, "worstRating": 1, "ratingValue": 6.2}, "g