{"url": "https://www.imdb.com/title/tt0084967/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0084967/", "name": "The A-Team", "image": "https://m.media-amazon.com/images/M/MV5BMzI0MjI1NjU5OF5BMl5BanBnXkFtZTcwNzg5NDUyMQ@@._V1_.jpg", "description": "Four Vietnam vets, framed for a crime they didn&apos;t commit, help the innocent while on the run from the military.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0084967/"}, "author": {"@type": "Person", "name": "Roverthemoon25"}, "dateCreated": "2005-10-04", "inLanguage": "English", "name": "Best 80&apos;s Show  ever", "reviewBody": "I remember watching this when it first was aired in the UK, it was on a Friday night and I was about 12 years old.\n\nAfter watching it I knew it was a show that I would watch every week, this was certainly different from any other action show I had seen before.\n\nHere were 4 guys who were on the run from the government but helped people out with problems they had, they were different types of guys but put them together and they made The A Team.\n\nHannibal who always had a plan, they didn&apos;t always come out the way he planned but they worked.\n\nFace was the guy who could get anything from anywhere and always scammed hotels, planes etc for the team.\n\nB.A was the muscle and the mechanic in the team who could build and fix anything, Murdock was the insane pilot who was always broken out of the V A hospital when the team needed him.\n\nThere was also Amy and Tania who were reporters who separately attached themselves to the team for a while, although rumours were that George Peppard who played Hannibal was not happy with the female involvement in the show.\n\nAlso there was the MP Colonel&apos;s who tried to catch the A team , first there was Lynch and then Decker who was played by Lancs Le Gault and the character of Decker was the one who pursued the team the most.\n\nPeople do pick holes in the show like why did the team never shoot anyone and they always got locked up in a garage or warehouse where they would be able to build something to make their escape.\n\nBut you can pick holes in any fictional show, this was action packed family entertainment."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 37680, "bestRating": 10, "worstRating": 1, "ratingValue": 7.5}, "contentRating": "TV-PG", "genre": ["Action", "Adventure", "Crime"], "datePublished": "1983-01-23", "keywords": "gmc vandura,cult tv,good versus evil,mercenary,hero for hire", "actor": [{"@type": "Person", "url": "/name/nm0000577/", "name": "George Peppard"}, {"@type": "Person", "url": "/name/nm0001558/", "name": "Mr. T"}, {"@type": "Person", "url": "/name/nm0776239/", "name": "Dwight Schultz"}], "creator": [{"@type": "Organization", "url": "/company/co0026580/"}, {"@type": "Organization", "url": "/company/co0046592/"}, {"@type": "Person", "url": "/name/nm0004798/", "name": "Stephen J. Cannell"}, {"@type": "Person", "url": "/name/nm0526967/", "name": "Frank Lupo"}], "trailer": {"@type": "VideoObject", "name": "The A-Team: Complete Third Season", "embedUrl": "/video/imdb/vi1554693401", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BNzg3OWE4ZDMtOWY2NS00ZThjLTljYjUtNzg4ZDQzMGVjOWNlXkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BNzg3OWE4ZDMtOWY2NS00ZThjLTljYjUtNzg4ZDQzMGVjOWNlXkEyXkFqcGdeQXRyYW5zY29kZS13b3JrZmxvdw@@._V1_.jpg", "description": "The A-Team: Complete Third Season"}}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0084967/"], ["og:site_name", "IMDb"], ["og:title", "The A-Team (TV Series 1983\u20131987) - IMDb"], ["og:description", "The A-Team: Created by Stephen J. Cannell, Frank Lupo. With George Peppard, Dwight Schultz, Mr. T, Dirk Benedict. Four Vietnam vets, framed for a crime they didn't commit, help the innocent while on the run from the military."], ["og:type", "video.tv_show"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMzI0MjI1NjU5OF5BMl5BanBnXkFtZTcwNzg5NDUyMQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1366.120218579235"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt0090189/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0090189/", "name": "Toughlove", "image": "https://m.media-amazon.com/images/M/MV5BZjRmNWJjZWQtNjE4Ny00YTVjLTkzNzAtM2NkMWEyOTljZWJjXkEyXkFqcGdeQXVyMzU0NzkwMDg@._V1_.jpg", "description": "The Charters family falls into despair over their drug-addicted son Gary. They discuss his problems through the &quot;Toughlove&quot; program in searching for answers.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0090189/"}, "author": {"@type": "Person", "name": "culwin"}, "dateCreated": "1999-01-06", "inLanguage": "English", "name": "Whose parents are these??", "reviewBody": "This movie has a good concept, but... these have to be the dumbest parents in the entire world!  Instead of what it is supposed to show, troubled/problem kids, this movie is about parents who don&apos;t have a clue.  I don&apos;t know about the people who read this database, but if I did some of the stuff the kids do in this movie, my parents wouldn&apos;t have hesitated to move my stuff onto the front yard - these parents buy their kid a car!  The sad part is that there are parents like this.  No wonder the world is so screwed up.  Anyhow, skip this movie unless you are a totally clueless parent who needs to learn how to deal with crazy kids.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 4}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 135, "bestRating": 10, "worstRating": 1, "ratingValue": 5.9}, "genre": ["Drama"], "datePublished": "1985-10-13", "keywords": "teenage boy,teen angst,mother son relationship,husband wife relationship,father son relationship", "actor": [{"@type": "Person", "url": "/name/nm0001665/", "name": "Lee Remick"}, {"@type": "Person", "url": "/name/nm0001136/", "name": "Bruce Dern"}, {"@type": "Person", "url": "/name/nm0000574/", "name": "Jaso