{"url": "https://www.imdb.com/title/tt0111413/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0111413/", "name": "Thin Ice", "image": "https://m.media-amazon.com/images/M/MV5BMTM2NjQyMTY0M15BMl5BanBnXkFtZTcwMjI4MTIyMQ@@._V1_.jpg", "description": "Steffi, a black photographer, and her journalist friend Greg persuade a magazine editor to commission an article on New York&apos;s upcoming Gay Games. Only weeks before the event, however, Steffi is dumped by her ice skating partner a...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0111413/"}, "author": {"@type": "Person", "name": "Mark-129"}, "dateCreated": "2003-04-05", "inLanguage": "English", "name": "Manipulated", "reviewBody": "Manipulation is the name of the game in &quot;Thin Ice.&quot; This is the story of a London based lesbian journalist, who is also an amateur doubles figure skater, hoping to compete in, as well as cover, the NY Gay Games. When she breaks up with her significant other and desperate for a skating partner, sets her sights on a repressed young female skater as a replacement. What follows is a story following the writer&apos;s attempts to befriend, and then seduce the vulnerable young woman, who hungers for the attention the other gives. Although successful in her efforts, things fall apart dramatically when the truth behind the seduction is revealed.\n\nThin Ice is an adequate film. Part of the early first wave of well done lesbian films from the 1990s. The acting is fine and the erotic scenes are very tame for the subject matter. But, the story has problems. By making the reason for her attentions so selfish and manipulative, the story begins to feel rather unsavory and unpleasant. Even at the end, where a happy end is set up, the scenes were so forced, I was unsure whether happiness or pain lay ahead.\n\nWorth seeing. Watch for the cameo by Ian McKellen.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 5}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 126, "bestRating": 10, "worstRating": 1, "ratingValue": 6.3}, "genre": ["Comedy", "Romance", "Sport"], "datePublished": "1995-04-28", "keywords": "f rated,homosexual,journalism,lesbian,independent film", "actor": [{"@type": "Person", "url": "/name/nm0043019/", "name": "Charlotte Avery"}, {"@type": "Person", "url": "/name/nm0931627/", "name": "Sabra Williams"}, {"@type": "Person", "url": "/name/nm0237834/", "name": "James Dreyfus"}], "director": [{"@type": "Person", "url": "/name/nm0192479/", "name": "Fiona Cunningham-Reid"}], "creator": [{"@type": "Organization", "url": "/company/co0030329/"}, {"@type": "Person", "url": "/name/nm0192479/", "name": "Fiona Cunningham-Reid"}, {"@type": "Person", "url": "/name/nm0792451/", "name": "Geraldine Sherman"}], "duration": "PT1H28M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0111413/"], ["og:site_name", "IMDb"], ["og:title", "Thin Ice (1994) - IMDb"], ["og:description", "Thin Ice: Directed by Fiona Cunningham-Reid. With Charlotte Avery, Sabra Williams, James Dreyfus, Clare Higgins. Steffi, a black photographer, and her journalist friend Greg persuade a magazine editor to commission an article on New York's upcoming Gay Games. Only weeks before the event, however, Steffi is dumped by her ice skating partner and lover, thus jeopardizing the article. But she soon meets Natalie."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTM2NjQyMTY0M15BMl5BanBnXkFtZTcwMjI4MTIyMQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1855.46875"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["