{"url": "https://www.imdb.com/title/tt0034485/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0034485/", "name": "Babes on Broadway", "image": "https://m.media-amazon.com/images/M/MV5BMTdhNDRkZTYtYzBmZC00NzcwLWI1YWMtNTBhODljYmU0ODVhXkEyXkFqcGdeQXVyNjc0MzMzNjA@._V1_.jpg", "description": "Judy Garland and Mickey Rooney star in a musical directed by Busby Berkeley as two talented teenagers dreaming of success as Babes on Broadway.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0034485/"}, "author": {"@type": "Person", "name": "SimonJack"}, "dateCreated": "2014-04-24", "inLanguage": "English", "name": "War-time talent show for Rooney-Garland and company", "reviewBody": "&quot;Babes on Broadway&quot; is the third of four pairings of Mickey Rooney and Judy Garland in MGM musical revue films. And, it&apos;s a very good one. Besides the two stars, a number of other top actors and entertainers are part of this film. Fay Bainter, Donald Meek and James Gleason are the old-timers; and a number of young hoofers and singers add to the music show. Busby Berkeley also directs this one, and gives us some excellent samples of his music and dance extravaganzas. \n\nThe film has several very good songs \u2013 many of them popular then or from the past. The &quot;Hoe Down&quot; number and routine are very good, and the closing finale is a showcase of talent for Rooney and company. In one scene, Mickey as Tommy and Judy as Penny daydream and imagine themselves playing scenes and numbers by famous entertainers of the past. Penny does Faye Templeton singing &quot;Mary&apos;s a Grand Old Name,&quot; Blanche Ring singing &quot;Rings on My Fingers and Bells on My Toes&quot; (Irish brogue and all), and Sarah Bernhardt dialog in French. Tommy mimics Richard Mansfield in Cyrano de Bergerac, and plays Sir Harry Lauder, in kilt and cane, singing &quot;She&apos;s Ma Daisy.&quot; He sings George M. Cohan&apos;s &quot;Yankee Doodle Boy,&quot; and in the finale he does a hilarious mimic of Carmen Miranda. \n\nBesides his dancing and song, Rooney in this film plays the banjo and piano. His musical talents were as big as anyone&apos;s. He could also play the bass and drums \u2013 both like a pro. Some reviews think Rooney is overacting. But his mannerisms aren&apos;t hammy or mugging the camera. They are part of the energy and liveliness of his persona. While some people may not like it, that&apos;s what his character is and was meant to be, and most of the public in those days thoroughly enjoyed that type of entertainment.\n\nOne or two reviews thought the British school kids scene wasn&apos;t necessary or was out of place. I don&apos;t think so. Remembering that this was during the war, and that England had been getting blitzed by Germany, I think this was a nice touch. Hollywood had a sense of patriotism and pulling together during the war, and it served our country and allies very well. If anything, this is a small tribute to the movie industry for its contributions in helping lift the spirits of people at home and abroad. \n\nThis is a fun and enjoyable song and dance film. What&apos;s not to like? Today, people spend $50 to $100 for tickets to a single concert, few if any of which have near the variety of wholesome stage entertainment.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 1546, "bestRating": 10, "worstRating": 1, "ratingValue": 6.6}, "contentRating": "Approved", "genre": ["Comedy", "Family", "Musical"], "keywords": "teenage boy,teenage girl,blackface,dancer,dancing", "trailer": {"@type": "VideoObject", "name": "Babes on Broadway", "embedUrl": "/video/imdb/vi3771710489", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BNWRmZGRmMmMtYjg5ZS00ZDM1LTkxYWUtODc4OTc1NTJkMzIwXkEyXkFqcGdeQXRoaXJkLXBhcnR5LXZpZGVvLXVw