{"url": "https://www.imdb.com/title/tt0181875/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0181875/", "name": "Almost Famous", "image": "https://m.media-amazon.com/images/M/MV5BMzY1ZjMwMGEtYTY1ZS00ZDllLTk0ZmUtYzA3ZTA4NmYwNGNkXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_.jpg", "description": "A high-school boy in the early 1970s is given the chance to write a story for Rolling Stone magazine about an up-and-coming rock band as he accompanies them on their concert tour.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0181875/"}, "author": {"@type": "Person", "name": "Quinoa1984"}, "dateCreated": "2000-09-18", "inLanguage": "English", "name": "Surprisingly sweet dramedy hits the mark", "reviewBody": "This film may have just one flaw- it aims too high.  But that doesn&apos;t matter in this world.  Here, we see the autobiographical tale of Cameron Crowe (writer/director and co-producer of this film) in his days as a young writer for Rolling Stone (one story I think) as seen by William Miller.  He follows a rock band called Stillwater (much to mom&apos;s dismay played well by Frances McDormand) on a Almost Famous tour with rockers, groupies and bandaids. Real sweetness comes when the worlds of Miller and the band combine and dramedy kicks in.  Quite the Crowe picture, one of his best ones, that takes a look at the days of rock when it was still cool to do drugs, have sex and be cool singing Elton John in a bus (that scene was the highlight).  Band members include Billy Crudup, Jason Lee and others including Fairuza Balk, Anna Paquin, and in a exceptional performance, the free spirited Penny Lane played by Kate Hudson.  This film is definately in my top 25 list of the year.  A-", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 272871, "bestRating": 10, "worstRating": 1, "ratingValue": 