{"url": "https://www.imdb.com/title/tt0479585/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0479585/", "name": "Comic Relief: Behind the Nose", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0479585/"}, "author": {"@type": "Person", "name": "BlizzardBunny"}, "dateCreated": "2015-11-29", "inLanguage": "English", "name": "Very Enjoyable", "reviewBody": "This is a nice Comic Relief documentary, which whilst being humorous, also maintains a sense of seriousness. I first watched this in class, where we were learning about poverty in Africa and have tried looking for it online since. The cast is very strong, with the likes of Tony Robinson, Rowan Atkinson, Jim Broadbent and others that make viewing a delight. Being a fan of Blackadder this was brilliant for me! I don&apos;t know the name of the man who did the mural, but I thought that the mural was excellent! All in all a good production, not too dissimilar an experience from watching Blackadder... it&apos;s the same kind of British humour that gives us our identity. In general, Comic Relief is a great thing for us to have... we can laugh, but we also encourage charity for vital causes. Again, I really wish that I could find this somewhere as I really enjoyed watching it!", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 13, "bestRating": 10, "worstRating": 1, "ratingValue": 5.9}, "genre": ["Comedy"], "keywords": "alternative comedy", "actor": [{"@type": "Person", "url": "/name/nm0377901/", "name": "Lenny Henry"}, {"@type": "Person", "url": "/name/nm0722619/", "name": "Griff Rhys Jones"}, {"@type": "Person", "url": "/name/nm0743552/", "name": "Jonathan Ross"}], "director": [{"@type": "Person", "url": "/name/nm0376487/", "name": "John Henderson"}], "creator": [{"@type": "Organization", "url": "/company/co0130080/"}]}], "open