{"url": "https://www.imdb.com/title/tt0030651/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0030651/", "name": "Radio City Revels", "image": "https://m.media-amazon.com/images/M/MV5BMjY5MTYxMTEtYmUyMC00Yzc0LWI1YzItN2FjMmRjYjliNTYzXkEyXkFqcGdeQXVyMzg1ODEwNQ@@._V1_.jpg", "description": "A songwriter uses the songs one of his pupils writes while sleeping for his own contract.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0030651/"}, "author": {"@type": "Person", "name": "SimonJack"}, "dateCreated": "2022-02-06", "inLanguage": "English", "name": "Old-fashioned entertainment has some very good entertainers", "reviewBody": "&quot;Radio City Revels&quot; is a comedy musical that is best for its music and dancing. The plot is silly and centers around a washed up songwriter, Jack Oakie, who discovers a correspondence student of his who composes songs in his sleep. He and his sidekick, a young Milton Berle tap Bob Burns for a number of hit songs. A young couple meet, Burns falls for Ann Miller, who falls for Kenny Baker (and him for her), while Helen Broderick latches onto Burns. Victor Moore is a radio show producer they all play up to.\n\nWell, all the attempts at comedy (they are just that, at best) and romance pale, and just serve to tie together some very talented folks who sing and dance. It&apos;s an old-fashioned revue type of musical. Some of the leads of the cast weren&apos;t in many films. Ann Miller&apos;s tap dancing is a delight to watch, and some choreographed dance numbers are very good. This is just one of two feature films in which Jane Froman appears and sings. She had a great voice, and it&apos;s too bad she wasn&apos;t in more films. Her story was the subject of a very good 1952 musical biopic, &quot;With a Song in My Heart,&quot; in which Susan Hayward played Froman. But one gets to hear that tremendous voice because she sang all the songs for the film that Hayward lip-synched.\n\nI couldn&apos;t tell who a woman dancer is in this film, who seems to be triple-jointed. She does a number that includes super high kicks that seem to be perpendicular above her head. The only entertainer I know of who could do that was Charlotte Greenwood, but it doesn&apos;t appear to be her and she&apos;s not listed in the credits. Some other entertainers give good dance and movement routines that seem to have gone out with vaudeville. But they&apos;re very entertaining and interesting to watch.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 6}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 122, "bestRating": 10, "worstRating": 1, "ratingValue": 5.9}, "contentRating": "Approved", "genre": ["Comedy", "Musical", "Romance"], "datePublished": "1938-02-11", "keywords": "tap dancing,song,arkansas,radio,songwriter", "actor": [{"@type": "Person", "url": "/name/nm0122589/", "name": "Bob Burns"}, {"@type": "Person", "url": "/name/nm0642988/", "name": "Jack Oakie"}, {"@type": "Person", "url": "/name/nm0048653/", "name": "Kenny Baker"}], "director": [{"@type": "Person", "url": "/name/nm0831577/", "name": "Benjamin Stoloff"}], "creator": [{"@type": "Organization", "url": "/company/co0041421/"}, {"@type": "Person", "url": "/name/nm0204537/", "name": "Eddie Davis"}, {"@type": "Person", "url": "/name/nm0112142/", "name": "Matt Brooks"}, {"@type": "Person", "url": "/name/nm0892044/", "name": "Anthony Veiller"}], "duration": "PT1H30M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0030651/"], ["og:site_name", "IMDb"], ["og:title", "Radio City Revels (1938) - IMDb"], ["og:description", "Radio City Revels: Directed by Benjamin Stoloff. With Bob Burns, Jack Oakie, Kenny Baker, Ann Miller. A songwriter uses the songs one of his pupils writes while sleeping for his own contract."], ["og:type", "video.movie"], ["og:image", "https://m.med