{"url": "https://www.imdb.com/title/tt0795452/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0795452/", "name": "The Republic Pictures Story", "image": "https://m.media-amazon.com/images/M/MV5BYTM3ZWVmMTQtZmI2My00MjY5LWEyZTEtNzI2M2YzOWM1YzFhXkEyXkFqcGdeQXVyMDYxMTUwNg@@._V1_.jpg", "description": "A history of Republic Pictures studios, featuring hundreds of clips plus on-camera interviews with stars, director, stuntman, etc.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0795452/"}, "author": {"@type": "Person", "name": "ptb-8"}, "dateCreated": "2008-01-24", "inLanguage": "English", "name": "My funny valentine....", "reviewBody": "The title says it all: a terrific TV documentary on the History of Republic PICTURES.... not so much the creation of and decline of THE STUDIO. Clearly lovingly crafted and well edited there are dozens of clips from every genre of feature film made at the studio from 1936 to the mid 50s. The serial chapters and the musical chapters are possibly the zaniest and the witty narration speaks in appreciation to the silliness of a lot of the ideas and spectacle presented. This doco is a must for any collectors of B movie magic.... but I do have serious disappointments about this film and that is the fact that it is only a valentine to the films... the really fascinating (to me and anyone to whom REPUBLIC PICTURES appeals) is the way the studio was formed and why it collapsed in 1958. It is not an honest portrayal of the man behind the Studio: Herbert J Yates, to have omitted his startling and successful business practices, the history an value of Consolidated film laboratories, the use of trucolor, and the maddening promotion of his wife Vera Ralston... just presenting the clips is one wonderful thing, when for another 15 minutes of running time throughout the film (it is only 95 mins or so anyway) we interested viewers could have had a more honest account of this extraordinary production house that only existed for 23 years but had a massive impact on pop culture world wide. Anyone who watches this doco even by mistake will find it fascinating and if greater detail of the rise and decline was presented would only make this good documentary into a great one. THE RKO STORY presented in 6 parts was an epic revelation, and this one could have easily been at that A grade level had it chosen to present the &apos;behined the scenes&apos; business data and scheming (and uproar). A part 2 as suggested would be equally fascinating.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 24, "bestRating": 10, "worstRating": 1, "ratingValue": 7.6}, "genre": ["Documentary"], "datePublished": "1991-03-15", "actor": [{"@type": "Person", "url": "/name/nm0000810/", "name": "Gene Autry"}, {"@type": "Person", "url": "/name/nm0169067/", "name": "Frank Coghlan Jr."}, {"@type": "Person", "url": "/name/nm0262661/", "name": "Dale Evans"}], "director": [{"@type": "Person", "url": "/name/nm0606727/", "name": "Len Morris"}], "creator": [{"@type": "Organization", "url": "/company/co0019701/"}, {"@type": "Person", "url": "/name/nm2238454/", "name": "Georgia Morris"}], "duration": "PT1H35M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0795452/"], ["og:site_name", "IMDb"], ["og:title", "The Republic Pictures Story (TV Movie 1991) - IMDb"], ["og:description", "The Republic Pictures Story: Directed by Len Morris. With Gene Autry, Frank Coghlan Jr., Dale Evans, Milos Forman. A history of Republic Pictures studios, featuring hundreds of clips plus on-camera interviews with stars, director, stuntman, etc."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BYTM3ZWVmMTQtZmI2My00MjY5LWEyZTEtNzI2M2YzOWM1YzFhXkEyXkFqcGdeQXVyMDYxMTUwNg@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1812.9770992366412"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
