{"url": "https://www.imdb.com/title/tt0035781/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0035781/", "name": "The Daring Young Man", "image": "https://m.media-amazon.com/images/M/MV5BYjA0YzA2M2EtYTM5NS00NGIyLTk5M2ItZWE3OWRlMjI4OTMwXkEyXkFqcGdeQXVyMDMxMjQwMw@@._V1_.jpg", "description": "After the military turns him down, a man proves himself a hero by cracking a Nazi spy ring.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0035781/"}, "author": {"@type": "Person", "name": "mark.waltz"}, "dateCreated": "2002-09-16", "inLanguage": "English", "name": "Funny World War II Farce", "reviewBody": "Joe E. Brown made several dozen comedies throughout the 1930&apos;s and early 1940&apos;s, most of which are very mediocre and some extremely unfunny. At Warner Brothers, he was their comic star throughout the depression era, and his mild-mannered characters (with the loud yell from his overly large mouth when in trouble) were the perfect depression comic hero. By the time World War II arrived, Brown was reduced to a series of less-than-funny comedies at Columbia. I watched several of them along with this one, having little enthusiasm for the minimal amount of comedy they provided. That cannot be said for &quot;The Daring Young Man&quot;, an actually very funny low-budget comedy which was the best of the bunch.\n\nThe story has Brown in a dual role as a mild-mannered not-so- youngish young man determined to get into the Army who fails at every attempt. Brown also appears for the umpteenth time in drag, this time as his grandmother, probably the only time he actually played a female character. Reporters follow his every attempt to get into the army, and before you know it, Brown is a buffoon for the media. Of course, a group of Nazi spies come Brown&apos;s way, and he ends up a hero by the time the film&apos;s 73 minutes have passed.\n\nHaving appeared in drag in a very poor Columbia western comedy, &quot;Shut My Big Mouth&quot;, one of the few saving graces of that film, Brown pulled the same gag again. Let&apos;s just say Brown&apos;s drag would never threaten RuPaul or even Milton Berle. He is more of an American counterpart to Britain&apos;s Old Mother Reilly with his grandmotherly outfits that add comic effect to his characterization. In &quot;Shut My Big Mouth&quot;, he was supposed to be a bride, and looked more like Frankenstein&apos;s mother than the bride of. Here, Brown plays an elderly lady, combo of Old Mother Reilly and Jonathan Winter&apos;s Ma Frickle, and is absolutely hysterical in the part. There is a fashion show sequence where Brown (in his old lady guise) dresses in several glamorous outfits, and his shaunte-sashe&apos;s are hysterical. So are the reactions of his reluctant audience, which makes room for at least one classic wisecrack.\n\nThere is another hysterical sequence where Brown&apos;s male character finds himself in the hospital with a tyrannical nurse (the always dependable &quot;B&quot; character actress Minerva Urecal, from the Bela Lugosi Monogram horror films) where Granny makes an unexpected appearance and gives the ultimate revenge that would stifle both Nurse Ratched and Diesel. The finale is filled with some great slapstick that barely gives the audience to catch their breath from all that has happened prior.\n\nThe supporting cast is overshadowed by Brown who gives his all. His leading lady, Marguerite Chapman, gets very little to do. Look for a very young Lloyd Bridges.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 6}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 77, "bestRating": 10, "worstRating": 1, "ratingValue": 6.1}, "contentRating": "Approved", "genre": ["Comedy", "Romance", "War"], "datePublished": "1942-10-08", "keywords": "blackface,male police officer,police officer,kiss,grandmother grandson relationship", "actor": [{"@type": "Person", "url": "/name/nm0113873/", "name": "Joe E. Brown"}, {"@type": "Person", "url": "/name/nm0152460/", "name": "Marguerite Chapman"}, {"@type": "Person", "url": "/name/nm0942929/", "name": "William Wright"}], "director": [{"@type": "Person", "url": "/name/nm0833965/", "name": "Frank R. Strayer"}], "creator": [{"@type": "Organization", "url": "/company/co0050868/"}, {"@type": "Person", "url": "/name/nm0223248/", "name": "Karen DeWolf"}, {"@type": "Person", "url": "/name/nm0071683/", "name": "Connie Lee"}], "duration": "PT1H13M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0035781/"], ["og:site_name", "IMDb"], ["og:title", "The Daring Young Man (1942) - IMDb"], ["og:description", "The Daring Young Man: Directed by Frank R. Strayer. With Joe E. Brown, Marguerite Chapman, William Wright, Roger Clark. After the military turns him down, a man proves himself a hero by cracking a Nazi spy ring."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BYjA0YzA2M2EtYTM5NS00NGIyLTk5M2ItZWE3OWRlMjI4OTMwXkEyXkFqcGdeQXVyMDMxMjQwMw@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1453.1548757170171"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
