{"url": "https://www.imdb.com/title/tt0209031/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0209031/", "name": "Humor Risk", "image": "https://m.media-amazon.com/images/M/MV5BNzU3NzU1MTktNzU5NC00MjQ5LWJhZjEtOWU5YTJlZDBhYTVmXkEyXkFqcGdeQXVyMTQ3NDkyNDAz._V1_.jpg", "description": "Harpo played the hero, a detective named Watson who &quot;made his entrance in a high hat, sliding down a coal chute into the basement&quot;. Groucho played an &quot;old movie&quot; villain, who &quot;sported a long mustache and was clad in black&quot;, while ...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0209031/"}, "author": {"@type": "Person", "name": "planktonrules"}, "dateCreated": "2006-05-04", "inLanguage": "English", "name": "How can ANYONE rate or review this movie???!!??!!??", "reviewBody": "Since the movie was only shown once and the last time was about 80 years ago, how can anyone review this film or give a rating score??!! To make this appeal to others NOT to rate or review this film, I was forced by IMDb to give a rating but how could I?!?! Unless someone who is well into their upper 90s or older can come forward and rate and review this film, I really don&apos;t think it makes any sense at all to speculate about this picture. Groucho supposedly said it was lousy and this is probably the best available assessment of the film. And, how can the film have a rating of over 7? It seems that fans of the comedy team are voting on how popular or good the group is WITHOUT REGARD TO WHETHER OR NOT THEY SAW THE FILM! My opinion is that if you haven&apos;t seen this film, don&apos;t rate it! And, if you know where there is a hidden copy of the film, sell it and make a fortune and earn the undying gratitude of Marxophiles!\n\nBy the way, another reason it&apos;s sad that this film probably no longer exists is that Harold Lloyd fans can see two of his frequent co-stars (one of which who became Mrs. Lloyd) in the film--Mildred Davies (Mrs. Lloyd) and Jobyna Ralston. Too bad..."}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 93, "bestRating": 10, "worstRating": 1, "ratingValue": 8}, "genre": ["Comedy", "Short"], "keywords": "lost film", "actor": [{"@type": "Person", "url": "/name/nm0000050/", "name": "Groucho Marx"}, {"@type": "Person", "url": "/name/nm0555617/", "name": "Harpo Marx"}, {"@type": "Person", "url": "/name/nm0555597/", "name": "Chico Marx"}], "director": [{"@type": "Person", "url": "/name/nm0807967/", "name": "Richard Smith"}], "creator": [{"@type": "Organization", "url": "/company/co0018924/"}, {"@type": "Person", "url": "/name/nm0842485/", "name": "Jo Swerling"}], "duration": "PT20M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0209031/"], ["og:site_name", "IMDb"], ["og:title", "Humor Risk (Short 1921) - IMDb"], ["og:description", "Humor Risk: Directed by Richard Smith. With Groucho Marx, Harpo Marx, Chico Marx, Zeppo Marx. Harpo played the hero, a detective named Watson who \"made his entrance in a high hat, sliding down a coal chute into the basement\". Groucho played an \"old movie\" villain, who \"sported a long mustache and was clad in black\", while Chico was probably his \"chuckling [Italian] henchman\". Zeppo portrayed a playboy who was the owner of a nightclub in which most of the action took place, including \"a cabaret, [which allowed] the inclusion of a dance number\". The final shot showed Groucho \"in ball and chain, trudging slowly off into the gloaming\". Harpo, in a rare moment of romantic glory, gets the girl in the end."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BNzU3NzU1MTktNzU5NC00MjQ5LWJhZjEtOWU5YTJlZDBhYTVmXkEyXkFqcGdeQXVyMTQ3NDkyNDAz._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "750"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate