{"url": "https://www.imdb.com/title/tt0044414/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0044414/", "name": "La berg\u00e8re et le ramoneur", "alternateName": "The Curious Adventures of Mr. Wonderbird", "image": "https://m.media-amazon.com/images/M/MV5BMGUzNTUwZGEtYmVkNC00MGUwLTg3ZmQtM2EzMDRjY2Y3MTlkXkEyXkFqcGdeQXVyMDI3OTIzOA@@._V1_.jpg", "description": "A chimney sweep and his beloved shepherdess are aided by Wonderbird (Sir Peter Ustinov) in their escape from a ruthless dictator.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0044414/"}, "author": {"@type": "Person", "name": "krasnegar"}, "dateCreated": "2007-06-26", "inLanguage": "English", "name": "Wonderful Film! Available Cheap! Very Cheap!", "reviewBody": "I just picked this up in a decent if not outstanding DVD version for one dollar at Wal Mart.\n\nRun out and buy it.\n\nI&apos;m fairly sure that this version is the short, incomplete version released against the animator&apos;s wishes in the late Fifties, but even so, at a buck it&apos;s an *incredible* bargain.\n\nThis film was syndicated in small chunks as a serial to local TV stations in the early 60s for the kid&apos;s shows that almost every station ran on weekday afternoons in those days - &quot;Mr Bill and Bozo&quot;, &quot;Monty&apos;s Gang&quot; (Channel 4, Greenville SC) and &quot;Captain Grady&quot; (channel 13, Asheville NC - which is where i saw it). It made such an impression on twelve-or-so-old me that i immediately recognised it when i spotted it in Wal Mart tonight and grabbed it.\n\nWonderful. You should get it.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 266, "bestRating": 10, "worstRating": 1, "ratingValue": 7.2}, "contentRating": "G", "genre": ["Animation", "Comedy", "Fantasy"], "keywords": "2d animation", "actor": [{"@type": "P