{"url": "https://www.imdb.com/title/tt0082894/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0082894/", "name": "Pennies from Heaven", "image": "https://m.media-amazon.com/images/M/MV5BMGZhOGViNzAtZjU5Ni00YTU1LTgyOGMtMjc5ZTA5YzM3ODc1XkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_.jpg", "description": "During the Great Depression, a sheet-music salesman seeks to escape his dreary life through popular music and a love affair with an innocent schoolteacher.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0082894/"}, "author": {"@type": "Person", "name": "moonspinner55"}, "dateCreated": "2007-10-21", "inLanguage": "English", "name": "It rains on its own parade...", "reviewBody": "Heavy-going, off-putting Depression-era musical (set to old recordings of the 1930s) is quite elaborate and usually looks good, but is filled with ciphers. Steve Martin, in a fair dramatic acting turn, plays a sex-obsessed sheet-music salesman in Chicago with no conscience who cheats on his frigid wife with a schoolteacher, later becoming involved in a murder investigation. Unfortunately for Martin, this character is such a crude, lascivious lout, we don&apos;t really care about his fate or whether or not his teacher-girlfriend (now a prostitute) leaves him. Jessica Harper (as the cold-fish wife) is every married man&apos;s nightmare: the bride-turned-shrew; Bernadette Peters is somewhat more sympathetic as the lover, and gets to utilize her natural Kewpie doll-ness to fantastic effect in the musical numbers. But, for the most part, &quot;Pennies From Heaven&quot; is peopled with low-lifes. The extravagant showstoppers, fantasy sequences designed like mini Busby Berkeley movies, are breathlessly intricate and exciting to watch, but they provide little emotional subtext for what&apos;s happening in the real world (I don&apos;t know if original creator Dennis Potter meant it or not, but the material plays like &quot;Up the Sandbox&quot; with music). Herbert Ross directed with a heavy hand, though he does get some fine moments from his cast, especially Christopher Walken as a hoofing pimp. An expensive remake of a British mini-series starring Bob Hoskins, the movie ultimately feels a bit claustrophobic and sluggish, and has an unsatisfying wrap-up to its reedy-thin plot. **1/2 from ****", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 6}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 5764, "bestRating": 10, "worstRating": 1, "ratingValue": 6.5}, "contentRating": "R", "genre": ["Drama", "Musical", "Romance"], "datePublished": "1982-01-01", "keywords": "police,vengeful wife,blinking light,movie theater,finger snap", "trailer": {"@type": "VideoObject", "name": "Pennies from Heaven: Trailer", "embedUrl": "/video/imdb/vi1390714137", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMTUyMTczMzk5OF5BMl5BanBnXkFtZTgwNTUyNTIyMzE@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMTUyMTczMzk5OF5BMl5BanBnXkFtZTgwNTUyNTIyMzE@._V1_.jpg", "description": "Watch the trailer for Pennies from Heaven, starring Steve Martin and Bernadette Peters. "}, "actor": [{"@type": "Person", "url": "/name/nm0000188/", "name": "Steve Martin"}, {"@type": "Person", "url": "/name/nm0001613/", "name": "Bernadette Peters"}, {"@type": "Person", "url": "/name/nm0363888/", "name": "Jessica Harper"}], "director": [{"@type": "Person", "url": "/name/nm0006889/", "name": "Herbert Ross"}], "creator": [{"@type": "Organization", "url": "/company/co0007143/"}, {"@type": "Organization", "url": "/company/co0142386/"}, {"@type": "Organization", "url": "/company/co0004452/"}, {"@type": "Person", "url": "/name/nm0693259/", "name": "Dennis Potter"}], "duration": "PT1H48M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0082894/"], ["og:site_name", "