{"url": "https://www.imdb.com/title/tt0460700/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVEpisode", "url": "/title/tt0460700/", "name": "Audrey Hepburn: The Fairest Lady", "image": "https://m.media-amazon.com/images/M/MV5BNzkwMzEzMTI4M15BMl5BanBnXkFtZTcwNTIwNDAzMQ@@._V1_.jpg", "description": "The story of how Audrey Hepburn survived World War II, became an award winning actress, and gave back to the world as a humanitarian.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0460700/"}, "author": {"@type": "Person", "name": "tavm"}, "dateCreated": "2021-02-14", "inLanguage": "English", "name": "Audrey Hepburn: The Fairest Lady was another fine ep of &quot;Biography&quot;", "reviewBody": "Just watched this &quot;Biography&quot; episode on the DVD of How to Steal a Million which starred this subject of that show-Audrey Hepburn. It chronicled her life growing up in the Netherlands before going to England where she started appearing in bit parts on films made there before then coming to Hollywood after her first starring role in Roman Holiday which was shot on location and which got her an Oscar for Best Actress. She then made Sabrina which led to her brief romance with William Holden and then she went back to Broadway where she met and then married fellow actor Mel Ferrer. Her son Sean came from that union. She&apos;d then continue to be successful in more movies but she also tried to keep a private life when possible while living in Switzerland. I&apos;ll just now mention that the rest of her life and career is also chronicled up to her charity work for UNICEF near the end of it. There&apos;s also interviews with Sean as well as director Blake Edwards who helmed her in one of her most popular films-Breakfast at Tiffany&apos;s and of her last partner in life, actor Robert Wolders. I&apos;ll just now say that Audrey Hepburn: The Fairest Lady is well worth a look.", "reviewRating": {"@type": "Rating", 