{"url": "https://www.imdb.com/title/tt0122494/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0122494/", "name": "La freccia azzurra", "alternateName": "How the Toys Saved Christmas", "image": "https://m.media-amazon.com/images/M/MV5BMTc5NTY2NzA2Nl5BMl5BanBnXkFtZTcwMDk0NDQyMQ@@._V1_.jpg", "description": "A group of toys take matters into their own hands when their Christmas delivery is in jeopardy.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0122494/"}, "author": {"@type": "Person", "name": "JeanPaulJ"}, "dateCreated": "2005-08-23", "inLanguage": "English", "name": "Wonderful Cartoon", "reviewBody": "&quot;La Freccia Azzurra&quot; (The Blue Arrow) is a charming movie decrypting the story of several toys from the toy store of &quot;La Befana&quot; (Granny Rose) who are searching for a young Italian lad named &quot;Francesco&quot; and also in search for the owner (child) who will truly like them and love them. But yet nothing could go as simple as walking through the streets and not meet problems... They encounter close death, possible annihilation, and various other problems such as the Horrible Scarafoni (Mr. Grimm) who wishes nothing but to stop these toys to be able to sell them... I would just like to point out ONE simple thing that in the versions that are not in Italian you may understand that Granny Rose is a helper of Santa Claus which is completely false it is just because Granny Rose in Italian is &quot;La Befana&quot; an old witch who goes around giving gifts to children on the 6th of January in hopes of finding Jesus. Like the Dutch, Italian children get visited by two imaginary people each, in the case of the Dutch, Saint-Nicholas and Santa Claus and for the Italians Santa Claus and then the &quot;Befana&quot;. Watch this movie to see an epic journey of several toys as they struggle to find a master who will love them.", "reviewRating": {"@type": "Rating", "w