{"url": "https://www.imdb.com/title/tt0045783/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0045783/", "name": "Fort Algiers", "image": "https://m.media-amazon.com/images/M/MV5BN2M2MjEyZTgtZWQyMy00MWY3LThlNjYtZGEwNGUyMTQwNDZhXkEyXkFqcGdeQXVyMzg1ODEwNQ@@._V1_.jpg", "description": "In northwest Africa, a tribal leader tries to stir up a rebellion against the ruling powers.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0045783/"}, "author": {"@type": "Person", "name": "Marlburian"}, "dateCreated": "2015-11-08", "inLanguage": "English", "name": "Undemanding adventure yawn", "reviewBody": "I watched this courtesy of the Movies4Men channel, which offers a very wide range of quality. This was middling. Set in the early 1950s, it seemed to have an early-20th-century atmosphere to it, with massed Arab attacks on Legionnaire forts and columns of soldiers marching to the rescue with no motorised or air support. There were a few mid-century cars in the stock footage of Paris and an Arab town, and Yvette does use an eavesdropping device, but that&apos;s all.\n\nThe actors do well enough, though I didn&apos;t recognise Leif Ericson as the crop-haired sergeant - he certainly chewed the scenery. And it&apos;s always good to see the dependable John Dehner (and Yvonne de Carlo).\n\nI was a bit puzzled by the Amir calling on his troops not to mention, on pain of death, the massacre at the beginning of the film, as it would have soon become common knowledge.\n\nThe mid-film relaying of the message did go on a bit and, as has been mentioned, there was something wrong with the distance and time when the Arabs arrived at the oil well.\n\nAll in all, pleasant, predictable viewing.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 6}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 201, "bestRating": 10, "worstRating": 1, "ratingValue": 5.4}, "contentRating": "Approved", "genre": ["Action", "Adventure", "Drama"], "datePublished": "1953-07-15", "keywords": "algeria,french foreign legion,legionnaire,french soldier,north africa", "actor": [{"@type": "Person", "url": "/name/nm0001119/", "name": "Yvonne De Carlo"}, {"@type": "Person", "url": "/name/nm0859939/", "name": "Carlos Thompson"}, {"@type": "Person", "url": "/name/nm0000994/", "name": "Raymond Burr"}], "director": [{"@type": "Person", "url": "/name/nm0782947/", "name": "Lesley Selander"}], "creator": [{"@type": "Organization", "url": "/company/co0137921/"}, {"@type": "Person", "url": "/name/nm0820693/", "name": "Theodore St. John"}, {"@type": "Person", "url": "/name/nm0826873/", "name": "Frederick Stephani"}], "duration": "PT1H18M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0045783/"], ["og:site_name", "IMDb"], ["og:title", "Fort Algiers (1953) - IMDb"], ["og:description", "Fort Algiers: Directed by Lesley Selander. With Yvonne De Carlo, Carlos Thompson, Raymond Burr, Leif Erickson. In northwest Africa, a tribal leader tries to stir up a rebellion against the ruling powers."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BN2M2MjEyZTgtZWQyMy00MWY3LThlNjYtZGEwNGUyMTQwNDZhXkEyXkFqcGdeQXVyMzg1ODEwNQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1501.3192612137202"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
