{"url": "https://www.imdb.com/title/tt0053133/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0053133/", "name": "Odds Against Tomorrow", "image": "https://m.media-amazon.com/images/M/MV5BMGM4Nzc2NTYtMzNjYy00ODJlLTk0Y2EtYTBkMGI4YWM3MDYwXkEyXkFqcGdeQXVyMTY5Nzc4MDY@._V1_.jpg", "description": "In need of quick money, a fallen former cop recruits a hard-bitten ex-con and a debt-ridden nightclub singer to pull off a bank job. But as the animosity between them boils over, the entire plan threatens to implode.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0053133/"}, "author": {"@type": "Person", "name": "back2wsoc"}, "dateCreated": "2004-03-24", "inLanguage": "English", "name": "Starkly photographed, brutal, well acted character study/caper", "reviewBody": "Oscar-winning director Robert Wise (&quot;West Side Story&quot;, &quot;The Sound of Music&quot;) directs Harry Belafonte, Robert Ryan, Shelley Winters and Ed Begley to masterful performances in this grounbreaking, revelatory film.  Earl Slater (Ryan) is a bigoted small-time petty thief with a supportive but hapless live-in lover (Winters).  Johnny Ingram (Belafonte) is a down on his luck hustler/drummer who gets involved with a bank robbery scheme with Dave Burke (Begley).  Slater is also in on the heist, but must come to terms with his racist views with Ingram in order to pull off the plan.  This is an incredibly clear-eyed, no holds barred look at the kind of segregation that was alive at the time, with superb performances by all, including Gloria Grahame as Ryan and Winters&apos; love-starved neighbor, Helen, and Kim Hamilton as Belafonte&apos;s ex-wife, Ruth.  The film dosen&apos;t resort to theatrics to build its tension; that comes naturally, due to excellent ensemble work by the cast, a great jazz score by John Lewis and Joseph C. Brun&apos;s gritty camerawork.  An influential, brilliant film, not to be missed. ***1/2"