 Martin searches his father, a foreign worker from Italy, who is also Stefan's originator, which he didn't know. Their mother kept Martin, while Stefan was adopted. After the first shock, Stefan decides to join his \"new brother\" on his trip to Italy. They only have some photos and letters of a holiday trip to Cattolica and their father's name: Giuseppe Iacoviello. This is the beginning of an odyssey across Italy and their way to themselves..."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BYzhlNDFjMWMtYmM1Mi00M2Y3LWI0NmEtNzY2MTVhZWYwNTg3XkEyXkFqcGdeQXVyMzA3Njg4MzY@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1427.1186440677966"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
