{"url": "https://www.imdb.com/title/tt0446055/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0446055/", "name": "The Trials of Darryl Hunt", "image": "https://m.media-amazon.com/images/M/MV5BMTg5NDI5MDIzNV5BMl5BanBnXkFtZTcwMDM2NjM4Mg@@._V1_.jpg", "description": "&quot;The Trials of Darryl Hunt&quot; is a feature documentary about a brutal rape/murder case and a wrongly convicted man, Darryl Hunt, who spent nearly twenty years in prison for a crime he did not commit. Both a social justice story and ...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0446055/"}, "author": {"@type": "Person", "name": "tomgillespie2002"}, "dateCreated": "2015-03-29", "inLanguage": "English", "name": "An incredibly frustrating watch", "reviewBody": "In 1984, Winston-Salem, North Carolina, young white newspaper editor Deborah Sykes is brutally raped and murdered. A man with a history of violence and crime, claiming to be somebody else, phones the police to report that he has seen a young woman killed. A name given during the phone call leads the police to question young black male Darryl Hunt and his friend, and later take them in for further questioning. With a media s**t-storm generated by the slaying of a white woman in a black neighbourhood in a Southern state, what transpired next was one of the most shockingly vindictive miscarriages of justice in recent American history.\n\nDocumentaries surrounding wrongful imprisonments and the many failings of the American judicial system are extremely common, but The Trial of Darryl Hunt is particularly infuriating due to the involvement of Hunt himself; a humble, intelligent man who maintains his innocence and dignity throughout his many trials without a hint of hatefulness towards his accusers. He spent 19 years in prison for his imagined crime, his release only being granted after the exhaustive efforts of his legal team and dedicated community following. Ten years into his term, DNA evidence is presented that clears Hunt, but the judge rules that this only proves he didn&apos;t do the deed, not that he wasn&apos;t present.\n\nThe film never tries to be anything other than informative, and directors Ricki Stern and Anne Sundberg detail every movement in the case rather than getting over-stuffed with style. It&apos;s often an incredibly frustrating watch, made slightly more bearable by the sight of Hunt,older and heavier, being granted his freedom in the opening moments. It shows us a city divided by skin colour, where tension is still high in a country that believes it has moved on from its dark history, and where a black man can be proved guilty by an all-white jury for a crime he didn&apos;t do, the only evidence being broken testimony from a known liar, an ex-convict and a man who looks like he&apos;s stepped out of the Jim Crow South.\n\nwww.the-wrath-of-blog.blogspot.com", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 1054, "bestRating": 10, "worstRating": 1, "ratingValue": 7.6}, "contentRating": "PG-13", "genre": ["Documentary", "Crime"], "keywords": "wrongful conviction,trial,north carolina,murder,f rated", "trailer": {"@type": "VideoObject", "name": "The Trials of Darryl Hunt", "embedUrl": "/video/imdb/vi1928659225", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMzU0ZGU0N2ItYzRiYi00OWNjLTg2ZmEtMDVhMjQ5MGQwNWM5XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMzU0ZGU0N2ItYzRiYi00OWNjLTg2ZmEtMDVhMjQ5MGQwNWM5XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg", "description": "Home Video Trailer from Think Film, Inc"}, "actor": [{"@type": "Person", "url": "/name/nm4802934/", "name": "Evelyn Jefferson"}, {"@type": "Person", "url": "/name/nm4802532/", "name": "Fred Flagler"}, {"@type": "Person", "url": "/name/nm4801765/", "name": "John Reeves"}], "director": [{"@type": "Person", "url": "/name/nm0827830/", "name": "Ricki Stern"}, {"@type": "Person", "url": "/name/nm0839064/", "name": "Anne Sundberg"}], "creator": [{"@type": "Organization", "url": "/company/co0080941/"}, {"@type": "Person", "url": "/name/nm0827830/", "name": "Ricki Stern"}, {"@type": "Person", "url": "/name/nm0839064/", "name": "Anne Sundberg"}], "duration": "PT1H46M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0446055/"], ["og:site_name", "IMDb"], ["og:title", "The Trials of Darryl Hunt (2006) - IMDb"], ["og:description", "The Trials of Darryl Hunt: Directed by Ricki Stern, Anne Sundberg. With Evelyn Jefferson, Fred Flagler, John Reeves, Mary Anne Sheboy. \"The Trials of Darryl Hunt\" is a feature documentary about a brutal rape/murder case and a wrongly convicted man, Darryl Hunt, who spent nearly twenty years in prison for a crime he did not commit. Both a social justice story and a personally driven narrative, the film chronicles this capital case from 1984 through 2004. With exclusive footage from two decades, the film frames the judicial and emotional response to a chilling crime - and the implications that reverberate from Hunt's conviction - against a backdrop of class and racial bias in the South and in the American criminal justice system. This documentary is the culmination of ten years of research and filming. In 1993, inspired by claims of injustice and police conspiracy, the filmmakers began to shoot in North Carolina. Working from a mix of formats (16mm and 24P video) the film melds the visceral reality of a murder case with first person accounts and cinematic imagery, illuminating perceptions and memories of events as they unfolded for the people closest to this haunting story. This unique look at one man's loss and redemption challenges the assumption that all Americans have the right to unbiased justice. Hunt's story - while one man's personal journey - reflects systemic issues of national concern: cross-racial eyewitness identification, prosecutorial misconduct, inexperienced defense attorneys assigned to capital cases, racial bias in death penalty cases and errors in police procedure. Barry Scheck from The Innocence Project, who worked on Hunt's case for ten years, and Gary Wells, professor and eyewitness expert, offer concrete examples where errors occurred in Hunt's saga and offer future remedies and effective ideas to prevent future \"Darryl Hunts.\" Hunt himself addresses the need for systemic reforms to prevent wrongful convictions, underscoring the haunting reality that Hunt could have been sentenced to death and we would never have known this story."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTg5NDI5MDIzNV5BMl5BanBnXkFtZTcwMDM2NjM4Mg@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1477.3473407747865"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
{"url": "https://www.imdb.com/title/tt12585076/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt12585076/", "name": "Moonshot", "image": "https://m.media-amazon.com/images/M/MV5BYmFkZGFjMWEtMzYzNS00N2MzLWI4NDEtODA2NzIxN2JjOTAxXkEyXkFqcGdeQXVyNTA3MTU2MjE@._V1_.jpg", "description": "This romantic comedy with a twist follows two college students as they join forces in order to be reunited with their significant others, embarking on a lively journey that takes them wildly off course.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt12585076/"}, "author": {"@type": "Person", "name": "anaaannya"}, "dateCreated": "2022-04-05", "inLanguage": "English", "name": "One time watch film!", "reviewBody": "Moonshot was supposed to enchant me, but it never did. Condor&apos;s natural charisma should carry this, but Sprouse&apos;s Ryan Reynolds Lite chatter-snark grinds it to a halt. Goofy omnipresent robot voices interject one-liners, unmemorable supporting characters come and go, and the obligatory pseudo-philosophical two-blips-in-the-vastness-of-the-universe moments are more corny than profound. Such things aren&apos;t good or funny enough to take our attention away from the painful reality that our two protagonists are so thin and generic that their love story is dormant.\n\nAmong the hilarity, Moonshot primarily featured some light drama centered on two young people trying to figure out who they are and what they want to be, culminating with Walt giving Sophie advice about her relationship with another Mars-dwelling Dude. If properly executed and written, it would be a good starting point. However, the film tries to combine two genres by juxtaposing lightly combative banter and forced tender moments against Ikea Basics Spaceship backdrops, which, despite establishing a more cheery and optimistic tone than the usual austere dystopian-future fodder, feels like two ideas crudely stapled together. After seeing this, I honestly believe that Wall E and EVE had more chemistry and a better storyline than this film and lead casts.\n\nIn short, if you have nothing to do and nothing to watch one evening, you can stream it. Because- Moonshot appears to be a different kind of rom-com, but it tells the same old story. For me, it is only a one-time watch film.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 5}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 4364, "bestRating": 10, "worstRating": 1, "ratingValue": 5.5}, "contentRating": "PG-13", "genre": ["Comedy", "Romance", "Sci-Fi"], "datePublished": "2022-03-31", "keywords": "mars,space,hbo max,explore,friend", "trailer": {"@type": "VideoObject", "name": "Official Trailer", "embedUrl": "/video/imdb/vi458998553", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BZjgxYTY4MzMtNWQxNS00MTE4LTk1MDQtMGM3NzhmNzQ4MjM4XkEyXkFqcGdeQXNuZXNodQ@@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BZjgxYTY4MzMtNWQxNS00MTE4LTk1MDQtMGM3NzhmNzQ4MjM4XkEyXkFqcGdeQXNuZXNodQ@@._V1_.jpg", "description": "Follow Walt and Sophie as they join forces in order to be reunited with their significant others. The two embark upon a lively journey that winds up taking them both wildly and unexpectedly off course."}, "actor": [{"@type": "Person", "url": "/name/nm0819850/", "name": "Cole Sprouse"}, {"@type": "Person", "url": "/name/nm0103785/", "name": "Zach Braff"}, {"@type": "Person", "url": "/name/nm0940974/", "name": "Peter Woodward"}], "director": [{"@type": "Person", "url": "/name/nm6826585/", "name": "Christopher Winterbauer"}], "creator": [{"@type": "Organization", "url": "/company/co0330789/"}, {"@type": "Organization", "url": "/company/co0192833/"}, {"@type": "Organization", "url": "/company/co0380492/"}, {"@type": "Person", "url": "/name/nm5004245/", "name": "Max Taxe"}], "duration": "PT1H44M"}], "opengraph": [{"namespac