{"url": "https://www.imdb.com/name/nm0836328/", "metadata": {"json-ld": [{"@context": "http://schema.org", "@type": "Person", "url": "/name/nm0836328/", "name": "John Sturges", "image": "https://m.media-amazon.com/images/M/MV5BMTM0NzkwODQwMl5BMl5BanBnXkFtZTcwMzQ1NjEwMw@@._V1_.jpg", "jobTitle": ["Director", "Producer", "Editor"], "description": "John Sturges was an American film director, mostly remembered for his outstanding Western films. In 1992, Sturges was awarded a Golden Boot Award for his lifelong contribution to the Western genre. Sturges was born in the village of Oak Park, Illinois, within the Chicago metropolitan area. By 1930, the village had a population of 64,000 people. ...", "birthDate": "1910-01-03", "deathDate": "1992-08-18"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "http://www.imdb.com/name/nm0836328/"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTM0NzkwODQwMl5BMl5BanBnXkFtZTcwMzQ1NjEwMw@@._V1_UY1200_CR162,0,630,1200_AL_.jpg"], ["og:type", "actor"], ["og:title", "John Sturges - IMDb"], ["og:site_name", "IMDb"], ["og:description", "John Sturges, Director: The Great Escape. John Sturges was an American film director, mostly remembered for his outstanding Western films. In 1992, Sturges was awarded a Golden Boot Award for his lifelong contribution to the Western genre. Sturges was born in the village of Oak Park, Illinois, within the Chicago metropolitan area. By 1930, the village had a population of 64,000 people. ..."]]}]}}
{"url": "https://www.imdb.com/title/tt0047849/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0047849/", "name": "Bad Day at Black Rock", "image": "https://m.media-amazon.com/images/M/MV5BYmYzNDcyNmEtNGJhMS00M2Y2LTgxYTEtMzM3NjljNDEyOGFjXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_.jpg", "description": "A one-armed stranger comes to a tiny town possessing a terrible past they want to keep secret, by violent means if necessary.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0047849/"}, "author": {"@type": "Person", "name": "bkoganbing"}, "dateCreated": "2005-10-27", "inLanguage": "English", "name": "Spence licks the town with one arm", "reviewBody": "Bad Day at Black Rock turned out to be the final film that Spencer Tracy did on his MGM contract. The following year he was fired off the set of Tribute to a Bad Man and left MGM abruptly. Some reward for an actor who brought so much prestige to that studio.\n\nTracy gets off a train at a hole in the wall, whistlestop, speedtrap of a town called Black Rock located somewhere in the Mojave desert. He&apos;s looking for a Japanese farmer named Komoko who seems to have vanished. And the townspeople are downright unfriendly to the stranger.\n\nIt gradually dawns on Tracy that by probing about Komoko&apos;s whereabouts, he&apos;s stepped in one big festering pile and he&apos;s put himself in danger. What he does about it is the rest of the film.\n\nJohn Sturges keeps the tension going here worthy of an Alfred Hitchcock film. In fact if Hitchcock had ever decided to do a western and was presented with Bad Day at Black Rock, I doubt he could do it any better. Certain arty Hitchcock touches are missing, but the suspense is there. Sturges was in fact nominated for Best Director.\n\nAs was Tracy nominated for Best Actor. He lost ironically to one of his fellow cast members Ernest Borgnine who copped the big prize for Marty. But in fact any one of the small cast could have been nominated. I&apos;m not sure why chief villain Robert Ryan wasn&apos;t.\n\nA fews years later John Sturges directed another film The Law and Jake Wade about Robert Taylor being held prisoner by Richard Widmark and his gang. There was a lot of suspense there as well, similar to Bad Day at Black Rock, as to whether Taylor would escape his predicament.\n\nFor a feature film in 1955 it is a rather short one, less than 90 minutes. But as Tracy said in another film, what there is is cherce.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 9}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 21769, "bestRating": 10, "worstRating": 1, "ratingValue": 7.7}, "contentRating": "Passed", "genre": ["Crime", "Drama", "Mystery"], "datePublished": "1955-02-13", "keywords": "japanese american,year 1945,post world war two,stranger,hotel", "trailer": {"@type": "VideoObject", "name": "Bad Day At Black Rock", "embedUrl": "/video/imdb/vi3869705497", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMjhmYzM1ZDMtZWUzYi00MjkyLWIzN2MtOGM3OTdkMDY5ODM5XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMjhmYzM1ZDMtZWUzYi00MjkyLWIzN2MtOGM3OTdkMDY5ODM5XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg", "description": "Trailer for this mystery"}, "actor": [{"@type": "Person", "url": "/name/nm0000075/", "name": "Spencer Tracy"}, {"@type": "Person", "url": "/name/nm0752813/", "name": "Robert Ryan"}, {"@type": "Person", "url": "/name/nm0004282/", "name": "Anne Francis"}], "director": [{"@type": "Person", "url": "/name/nm0836328/", "name": "John Sturges"}], "creator": [{"@type": "Organization", "url": "/company/co0007143/"}, {"@type": "Person", "url": "/name/nm0442228/", "name": "Millard Kaufman"}, {"@type": "Person", "url": "/name/nm0570190/", "name": "Don McGuire"}, {"@type": "Person", "url": "/name/nm0107734/", "name": "Howard Breslin"}], "duration": "PT1H21M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0047849/"], ["og:site_name", "IMDb"], ["og:title", "Bad Day at Black Rock (1955) - IMDb"], ["og:description", "Bad Day at Black Rock: Directed by John Sturges. With Spencer Tracy, Robert Ryan, Anne Francis, Dean Jagger. A one-armed stranger comes to a tiny town possessing a terrible past they want to keep secret, by violent means if necessary."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BYmYzNDcyNmEtNGJhMS00M2Y2LTgxYTEtMzM3NjljNDEyOGFjXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1538.4615384615386"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
