{"url": "https://www.imdb.com/title/tt0120586/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0120586/", "name": "American History X", "image": "https://m.media-amazon.com/images/M/MV5BZTJhN2FkYWEtMGI0My00YWM4LWI2MjAtM2UwNjY4MTI2ZTQyXkEyXkFqcGdeQXVyNjc3MjQzNTI@._V1_.jpg", "description": "A former neo-nazi skinhead tries to prevent his younger brother from going down the same wrong path that he did.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0120586/"}, "author": {"@type": "Person", "name": "exa56"}, "dateCreated": "2006-01-26", "inLanguage": "English", "name": "A masterpiece! Truly one of the best film I have ever seen", "reviewBody": "I have been wanting to see this movie for a long time, since my English teacher mentioned it in our class in grade ten. Gosh I wished I wouldn&apos;t have waited all this time to finally watch it, although maybe it&apos;s a good thing cause I would have probably been a little bit more traumatized at 14... This movie is exceptional!!! Makes u think, makes you frustrated, makes you wanna scream and even makes you cry! Edward Norton is just phenomenal playing the role of a freak skin head and even more so playing this skin head who finally realizes how stupid he was and tries to protect his younger brother. Edward Furlong also does an amazing job!!! This film is moving in so many ways...I can&apos;t even describe how real and heartfelt it felt. I definitely think Edward Norton should have won the Oscar for his performance, cause he was absolutely terrific! I can&apos;t get why they didn&apos;t gave it to him... This movie will surely stay on my mind for a while now... just thinking that some place in the world things like that still happen...it crushes my heart. This is a wonderful movie that every single person should see at least once in his life... Watch American History X, it totally worth it!", "reviewRating": {"@type": "Rating", "worst