{"url": "https://www.imdb.com/title/tt1340138/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt1340138/", "name": "Terminator Genisys", "image": "https://m.media-amazon.com/images/M/MV5BMjM1NTc0NzE4OF5BMl5BanBnXkFtZTgwNDkyNjQ1NTE@._V1_.jpg", "description": "When John Connor, leader of the human resistance, sends Sgt. Kyle Reese back to 1984 to protect Sarah Connor and safeguard the future, an unexpected turn of events creates a fractured timeline.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1340138/"}, "author": {"@type": "Person", "name": "Sleepin_Dragon"}, "dateCreated": "2020-09-03", "inLanguage": "English", "name": "Much better than I expected.", "reviewBody": "I was told multiple times that it was awful, boring, unwatchable, so foolishly I didn&apos;t.\n\nHowever, I thought I&apos;d give it a try, and I really liked it. Of course it&apos;s flawed, of course it&apos;s outrageous and over the top, but the good heavily outweighs the bad, it made me feel incredibly nostalgic, plenty of references and heads up to the first two films.\n\nIt was a huge gamble to bring Arnie back, I think he&apos;s brilliant here, I&apos;ve never been a huge lover of him as an actor, but in this role he is iconic. He&apos;s great. Great to see Matt Smith.\n\nMassive special effects, it&apos;s all guns blazing. It is perhaps a little too long.\n\nTotally enjoyed it, 7/10.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 274525, "bestRating": 10, "worstRating": 1, "ratingValue": 6.3}, "contentRating": "PG-13", "genre": ["Action", "Adventure", "Sci-Fi"], "datePublished": "2015-07-01", "keywords": "cyborg,future,time machine,human versus cyborg,human versus robot", "trailer": {"@type": "VideoObject", "name": "Trailer #2", "embedUrl": "/video/imdb/vi1249751321", "thumbnail": {"@type": "Imag