{"url": "https://www.imdb.com/title/tt0115378/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "TVSeries", "url": "/title/tt0115378/", "name": "Superman", "alternateName": "Superman: The Animated Series", "image": "https://m.media-amazon.com/images/M/MV5BNDgzOWJjOTMtZjY4ZS00MGRkLTk0YTMtM2E3ZGQyYmMyYzkzXkEyXkFqcGdeQXVyMTA1OTEwNjE@._V1_.jpg", "description": "The last son of the planet Krypton protects his adoptive home of Earth as the greatest of the superheroes.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0115378/"}, "author": {"@type": "Person", "name": "goodsephiroth"}, "dateCreated": "2006-06-26", "inLanguage": "English", "name": "Superman best animated series", "reviewBody": "When you are watching this series you are feeling Superman is one of the greatest heroes in comics history. This series contains every details about Superman history. The history of his planet Kripton are the first three episodes of the season. You will learn about his weakness, his enemies and his friends through the episodes.\n\nLater in series you will see Superman teaming with another greats superheroes like Batman, Flash, Green Lantern and more. The episodes of Superman and Batman are excellent because are mixing enemies from both series. I recommend to watch Word&apos;s Finest episodes.\n\nLex Luthor is the main enemy of Superman but you will see in action more enemies like Metallo, Darkseid, Braniac, Joker and more. I like this series because Superman appear like he can be beaten. He have all the magnificent powers but the enemies are smart and they can destroy Superman if they want it. This make suspense in the series.\n\nThis is a very short series compared with Batman animated show. But every episodes are great and you don&apos;t wanna miss any one of them.\n\nI recommend this series.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "Aggre