{"url": "https://www.imdb.com/title/tt2721744/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt2721744/", "name": "City 40", "image": "https://m.media-amazon.com/images/M/MV5BMjM0NDY2MzEwNF5BMl5BanBnXkFtZTgwNTM1NDc5ODE@._V1_.jpg", "description": "Behind the walls of a forbidden city, the only thing more dangerous than its secrets is the truth.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt2721744/"}, "author": {"@type": "Person", "name": "JvH48"}, "dateCreated": "2018-10-05", "inLanguage": "English", "name": "Worrisome documentary. Makes us wonder what other places kept hidden for us in the interest of National Security, but equally dangerous for environment and people living there", "reviewBody": "Saw this at the Movies That Matter film festival 2017 in The Hague. The first half of the documentary presents a good overview of the purpose of City 40, what is happening there, what binds its inhabitants to the city, and what urges them to stay there. All this is perfectly understandable, despite the fact that the people living there have a restricted life and cannot tell anything about it to the outside world. But its infrastructure and provisioning is far better than elsewhere in the country, and luxury goods as well as cultural events are available, also much better than in the rest of the country. And as one of the talking heads said: &quot;scientists are busy with splitting atoms, and the rest does not interest them as long as they can continue with splitting atoms.&quot; Having a scientific background myself in physics, I fully recognize the truth in this statement.\n\n The second half was more worrying and made us aware of hidden side effects, particularly considering environmental issues with nuclear waste and accidents, of which Chernobyl is just an infamous example. Same applies to the people living in the city, who must sustain radiation and related dangers much more than at other places. Though not proven, there were suspicious effects on offspring due to genetic problems, probably becoming worse in future generations. I would not be surprised when there are many more of such places, hidden for us in the interest of National Security, and certainly not in former communist countries alone, but also in &quot;our&quot; part of the world.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 8}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 1545, "bestRating": 10, "worstRating": 1, "ratingValue": 6.5}, "genre": ["Documentary", "Drama", "History"], "datePublished": "2016-09-01", "keywords": "secret", "trailer": {"@type": "VideoObject", "name": "Official Trailer", "embedUrl": "/video/imdb/vi1357759001", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BNzZhNGUzYmEtNzZiNy00NWI3LTlhZjMtOWM4NGJkY2VlMWYzXkEyXkFqcGdeQWRpZWdtb25n._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BNzZhNGUzYmEtNzZiNy00NWI3LTlhZjMtOWM4NGJkY2VlMWYzXkEyXkFqcGdeQWRpZWdtb25n._V1_.jpg", "description": "Behind the walls of a forbidden city, the only thing more dangerous than its secrets is the truth."}, "actor": [{"@type": "Person", "url": "/name/nm0075186/", "name": "Lavrenti Beria"}, {"@type": "Person", "url": "/name/nm8859160/", "name": "Viktor Fetisov"}, {"@type": "Person", "url": "/name/nm0329784/", "name": "Mikhail Gorbachev"}], "director": [{"@type": "Person", "url": "/name/nm2136917/", "name": "Samira Goetschel"}], "creator": [{"@type": "Organization", "url": "/company/co0419310/"}, {"@type": "Person", "url": "/name/nm2136917/", "name": "Samira Goetschel"}, {"@type": "Person", "url": "/name/nm1101216/", "name": "Monique Zavistovski"}], "duration": "PT1H13M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt2721744/"], ["og:site_name", "IMDb"], ["og:title", "City 40 (2016) - IMDb"