{"url": "https://www.imdb.com/title/tt0481561/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0481561/", "name": "Lime Salted Love", "image": "https://m.media-amazon.com/images/M/MV5BMjE4MzQ0MDgxM15BMl5BanBnXkFtZTcwNDk1NDI4Mg@@._V1_.jpg", "description": "LIME SALTED LOVE is a minimalist, surreal examination of abandonment, guilt, abuse and psychic pain set in this minute&apos;s hipster enclaves of Los Angeles. The film, told in rippling flashbacks from its four main characters, drains ...", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0481561/"}, "author": {"@type": "Person", "name": "casla22"}, "dateCreated": "2010-02-07", "inLanguage": "English", "name": "A sample of the consequences of unresolved trauma", "reviewBody": "Kristanna Loken, producer and star of this film, said: This is not a happy film. And it&apos;s true. Chase, drag the trauma of a tragedy that destroyed his family. Ellie, was a victim of abuse of a violent mother and is a drug user; Zephyr, was victim of sexual abuse by her stepfather, so one day, with 12 years of age, decided to leave her house with her little sister. What happens when the trauma is not treated properly, resolved or channeled? They grow, make us make bad decisions. The unresolved traumas result in abuse, loss and despair. Chase meets Ellie, who later befriends Zephyr. Each, somehow, ends up being the fulcrum of another, even at times, even confusing. They are 3 young people who attempt to mitigate the pain, believing that all is well. But the past is there, always comes back because they do not find a way to delete it or overcome it. Is good to understand that in this world, many people are not happy. Some people spend a lifetime suffering. Sometimes the recipe for happiness just does not work, because there are things of the human condition rooted too deep. The movie is not filmed in chronological order. Some scenes begin with the end. There are surreal moments, how the Red Room scene, one of the best scenes I&apos;ve seen in recent times. Kristanna Loken is remarkable. This time no swords or axes. This time it&apos;s a visceral Kristanna. Expressive and intimate. She just glows, especially in the Red Room scene. We see a different Kristanna, proving that it has many more conditions than many suppose. In this film shows that, as an actress, she&apos;s not afraid and can cope easily with intense scenes. It&apos;s one of those actresses undervalued, which deserves better opportunities. This film shows what happens when you do not obtain the forgiveness of a loved one, when parents are absent. When guilt and low self-esteem are too big. When the world does not help. Today we are saturated with overproduced movies with too many special effects. So this kind of films are lost and have no distribution. They represent the efforts of young people wanting to tell stories and that makes them more valuable than a box-office film that says nothing. If you like predictable stories repeated, with many clich\u00e9s, but full of terrific special effects, go see Avatar. If you like poorly acted movies, but popular, full of cute guys, go see the Twilight saga. If, like me, you like independent film, made with effort, that dares to tell painful stories, this is a film that deserves a chance. I give this film my highest rating, for 3 simple reasons. Not intended to be more than it is. It is an independent effort well directed and well acted. Definitely, I faced with my own problems and I began to think about the decisions I made and the decisions which I have yet to take to avoid falling deeper.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 10}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 196, "bestRating": 10, "worstRating": 1, "ratingValue": 3.7}, "contentRating": "R", "genre": ["Drama"], "keywords": "f rated", "trailer": {"@type": "VideoObject", "name": "Lime Salted Love", "embedUrl": "/video/imdb/vi1812924185", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMmI2MThkMzMtNGRkMi00MWQ5LWEwNGEtOWYyOTA1MGI0NmM0XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMmI2MThkMzMtNGRkMi00MWQ5LWEwNGEtOWYyOTA1MGI0NmM0XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg", "description": "Trailer for Lime Salted Love"}, "actor": [{"@type": "Person", "url": "/name/nm0518085/", "name": "Kristanna Loken"}, {"@type": "Person", "url": "/name/nm2043675/", "name": "Joe Hall"}, {"@type": "Person", "url": "/name/nm2034753/", "name": "Danielle Agnello"}], "director": [{"@type": "Person", "url": "/name/nm2034753/", "name": "Danielle Agnello"}, {"@type": "Person", "url": "/name/nm2043675/", "name": "Joe Hall"}], "creator": [{"@type": "Person", "url": "/name/nm2043675/", "name": "Joe Hall"}, {"@type": "Person", "url": "/name/nm0236711/", "name": "Billy Drago"}, {"@type": "Person", "url": "/name/nm2034753/", "name": "Danielle Agnello"}], "duration": "PT1H32M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0481561/"], ["og:site_name", "IMDb"], ["og:title", "Lime Salted Love (2006) - IMDb"], ["og:description", "Lime Salted Love: Directed by Danielle Agnello, Joe Hall. With Kristanna Loken, Joe Hall, Danielle Agnello, David J. O'Donnell. LIME SALTED LOVE is a minimalist, surreal examination of abandonment, guilt, abuse and psychic pain set in this minute's hipster enclaves of Los Angeles. The film, told in rippling flashbacks from its four main characters, drains out of the eyes of the institutionally confined, David Triebel, his guilt-ridden younger brother, Chase, Ellie, his emotionally damaged girlfriend, and Zephyr, the sexual provocateur. In the visual narrative tradition of David Lynch the film depicts the tale of three bonded brothers broken by the accidental death of one and the residual guilt draping the remaining two The film examines how damaged people are hurt even more by their own willful ways. Sometimes it is the smallest things we do to others that destroys them..."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjE4MzQ0MDgxM15BMl5BanBnXkFtZTcwNDk1NDI4Mg@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1294.1176470588236"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
