{"url": "https://www.imdb.com/title/tt0460780/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt0460780/", "name": "In the Name of the King: A Dungeon Siege Tale", "image": "https://m.media-amazon.com/images/M/MV5BMTQ4ODI0ODA1Ml5BMl5BanBnXkFtZTcwNzMzMjU1MQ@@._V1_.jpg", "description": "A man named Farmer sets out to rescue his kidnapped wife and avenge the death of his son, two acts committed by the Krugs, a race of animal-warriors who are controlled by the evil Gallian.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt0460780/"}, "author": {"@type": "Person", "name": "matt-soulliere"}, "dateCreated": "2008-01-11", "inLanguage": "English", "name": "Who is Uwe Boll and what did we do to him to deserve this?", "reviewBody": "I went into this expecting a bad movie, you could say I was hoping for the best but expecting the worst. I&apos;m a fan of Jason Statham which made me want to see it despite my expectations, plus I work at a theatre and see movies for free which makes me less picky about the movies I watch.\n\nNow I don&apos;t typically leave reviews for movies, but after seeing this I felt that I needed to warn people. Up until tonight, I&apos;d never seen a movie directed/produced by this Uwe Boll guy and believe me, as I write this I wish that was still the case. There are no redeeming qualities to this movie and you realize it within the first ten minutes. The cast is brutal, Statham, Liota and Reynolds are all laughable as the main characters. The evil army of &apos;Krug&apos; reminded me of the dudes in monkey suits in the early Planet of the Apes movies. During action scenes you see the same shot over and over again as if they only had one shot of &apos;bad guy hit by arrow&apos;. Even the props were bad, Stathams sword looked like something you&apos;d give a six year old on Halloween.\n\nI don&apos;t even know if I can accurately put into words how bad this movie is. The best way to describe this pile is to piture you and your friends trying to remake &apos;lord of the rings&apos; in your backyard, because what you ended up with would be of similar quality.\n\nIf you read this review, don&apos;t make the same mistake I did. Don&apos;t watch it to see if it is as bad as the guy on the IMDb said it was. This movie should only be shown to criminals in jail as further punishment for their crimes.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 2}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 48981, "bestRating": 10, "worstRating": 1, "ratingValue": 3.8}, "contentRating": "PG-13", "genre": ["Action", "Adventure", "Fantasy"], "datePublished": "2008-01-11", "keywords": "trash movie,exploitation film,equestrian,kill,horseback riding", "trailer": {"@type": "VideoObject", "name": "In the Name of the King: A Dungeon Siege Tale", "embedUrl": "/video/imdb/vi884080921", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMjEyNjE1Njc1Ml5BMl5BanBnXkFtZTYwNTMzNDU4._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMjEyNjE1Njc1Ml5BMl5BanBnXkFtZTYwNTMzNDU4._V1_.jpg", "description": "In the Name of the King: A Dungeon Siege Tale Trailer"}, "actor": [{"@type": "Person", "url": "/name/nm0005458/", "name": "Jason Statham"}, {"@type": "Person", "url": "/name/nm0000579/", "name": "Ron Perlman"}, {"@type": "Person", "url": "/name/nm0000501/", "name": "Ray Liotta"}], "director": [{"@type": "Person", "url": "/name/nm0093051/", "name": "Uwe Boll"}], "creator": [{"@type": "Organization", "url": "/company/co0021154/"}, {"@type": "Organization", "url": "/company/co0137814/"}, {"@type": "Organization", "url": "/company/co0065717/"}, {"@type": "Person", "url": "/name/nm0852298/", "name": "Doug Taylor"}, {"@type": "Person", "url": "/name/nm2451367/", "name": "Jason Rappaport"}, {"@type": "Person", "url": "/name/nm1356655/", "name": "Dan Stroncak"}], "duration": "PT2H7M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt0460780/"], ["og:site_name", "IMDb"], ["og:title", "In the Name of the King: A Dungeon Siege Tale (2007) - IMDb"], ["og:description", "In the Name of the King: A Dungeon Siege Tale: Directed by Uwe Boll. With Jason Statham, Leelee Sobieski, John Rhys-Davies, Ron Perlman. A man named Farmer sets out to rescue his kidnapped wife and avenge the death of his son, two acts committed by the Krugs, a race of animal-warriors who are controlled by the evil Gallian."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMTQ4ODI0ODA1Ml5BMl5BanBnXkFtZTcwNzMzMjU1MQ@@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1434"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
