{"url": "https://www.imdb.com/title/tt4229236/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt4229236/", "name": "Cobain: Montage of Heck", "image": "https://m.media-amazon.com/images/M/MV5BMjIyOTcxMTU2NV5BMl5BanBnXkFtZTgwNjcyMDg3NDE@._V1_.jpg", "description": "An authorized documentary on the late musician Kurt Cobain, from his early days in Aberdeen, Washington to his success and downfall with the grunge band Nirvana.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt4229236/"}, "author": {"@type": "Person", "name": "Eric_Cubed"}, "dateCreated": "2015-06-24", "inLanguage": "English", "name": "Great,, super.", "reviewBody": "This is a documentary that presents another side of Kurt Cobain unseen by the public. What many don&apos;t understand is that, like Dylan&apos;s 3rd album, &quot;Another side of Bob Dylan,&quot; this is simply all this movie is, another perspective of the great grunge genius. Kurt was never a man, always a boy with the gift of genius. Unfortunately, all the risk factors for suicide were there: childhood abandonment, genetic family history of bi-polar illness and suicide (two uncles committed suicide), addiction to heroin, stress of fame, Severe Depression and, of course, a highly unhealthy and destructive relationship with Courtney Love. He never had a chance really, and those who loved him had no clue, couldn&apos;t have, at the path of destruction he was on. And yet, he left us with perhaps the best rock songs ever, especially on Nevermind, and I am sure his legacy will last for a long, long time. The scenes in this movie depict a Cobain at his best and his worst, strung out in his daughter&apos;s presence and raging on the stage. Like Amy Winehouse, Cobain was on a mission to self-destruction. We&apos;ve seen this before. Syd Barrett,Ian Curtis, Nick Drake, the list goes on. For those blessed with genius, the normal developmental milestones don&apos;t mean quite so much. At 21, most of us are struggling with independent living skills, young adulthood, etc. Not so with Kurt Cobain. He was busy proving to the world his potential, which like Dylan, he was very aware he was predestined for. The Blade-runner line, &quot;The light that burns twice as bright burns half as long&quot; is all too applicable to the life of Cobain, especially in light of his bi-polar illness. When I heard, &quot;You Know You&apos;re Right,&quot; I couldn&apos;t help but to feel helpless, angry at what might have come had he somehow lived, had he accepted Duff mckagan&apos;s invitation to chill with him that night (a Mckagan knew he was suffering). But like Poe, his creativity came from a well of mental illness, and that is the frame we must view Cobain in, for the kind of illness he suffered from is the kind that cannot last in it&apos;s piercing incarnation, at least without medication, be it heroin or lithium.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 29752, "bestRating": 10, "worstRating": 1, "ratingValue": 7.5}, "contentRating": "TV-MA", "genre": ["Documentary", "Animation", "Biography"], "datePublished": "2015-05-04", "keywords": "drug addiction,musician,media,intimacy,depression", "trailer": {"@type": "VideoObject", "name": "Trailer", "embedUrl": "/video/imdb/vi1263972633", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BMTQ3NzgyMzc2MV5BMl5BanBnXkFtZTgwNTI2MjI0NTE@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BMTQ3NzgyMzc2MV5BMl5BanBnXkFtZTgwNTI2MjI0NTE@._V1_.jpg", "description": "Watch a trailer for the highly anticipated documentary &quot;Kurt Cobain: Montage of Heck.&quot;"}, "actor": [{"@type": "Person", "url": "/name/nm0001052/", "name": "Kurt Cobain"}, {"@type": "Person", "url": "/name/nm7309288/", "name": "Wendy O&apos;Connor"}, {"@type": "Person", 