{"url": "https://www.imdb.com/title/tt1355640/", "metadata": {"json-ld": [{"@context": "https://schema.org", "@type": "Movie", "url": "/title/tt1355640/", "name": "The Shock Doctrine", "image": "https://m.media-amazon.com/images/M/MV5BMjI4MTQwMDU0NV5BMl5BanBnXkFtZTgwMzEyMzA2MDE@._V1_.jpg", "description": "An investigation of &quot;disaster capitalism&quot;, based on Naomi Klein&apos;s proposition that neo-liberal capitalism feeds on natural disasters, war and terror to establish its dominance.", "review": {"@type": "Review", "itemReviewed": {"@type": "CreativeWork", "url": "/title/tt1355640/"}, "author": {"@type": "Person", "name": "paul2001sw-1"}, "dateCreated": "2009-09-03", "inLanguage": "English", "name": "Half a case", "reviewBody": "We&apos;re all familiar with economic shock therapy, the idea that sometimes a massive destabilisation of the economy is the first step towards recovery. What Naomi Klein argues in her book, &apos;The Shock Doctrine&apos;, is that chaos is not just an occasionally necessary precursor of reform, but it rather exploited or at worst engineered by reform&apos;s proponents, because the consequences of the changes proposed would not be accepted by the people if offered to them a la carte in a less pressured environment. Michael Winterbottom&apos;s film develops Klein&apos;s arguments, and presents a fairly conventional alternative history of the world. But there are still some interesting details: I didn&apos;t know that it was Eisenhower, of all people, who first warned about the military-industrial complex; and it&apos;s welcome to see a different interpretation of what happened in Chile in the 1970s to the outrageous story told by Niall Fergusson in his recent BBC series, &apos;A History of Money&apos;. Yet I still felt slightly disappointed by this film, because while it exposes the lies of the new right to be friends of freedom and democracy (by showing how they need to suppress freedom to get their ideas through), it doesn&apos;t address the other part of the argument, namely, whether their economic ideas are basically sound. Perhaps it does indeed take unpopular policies to rescue broken economies; one can dispute that this belief justifies coercion, but should a rational people accept shock as a price worth paying? There are lots of good arguments that say no, but the film doesn&apos;t make them; the case that equality is an aid to the efficiency of a country, as well as a moral good in itself, is here taken for granted, although this is arguably the key point of difference between left and right. I fear that this film will not convert anyone while the right&apos;s most insidious claim, that a competitive jungle is, however distasteful, the best of all possible worlds, goes unchallenged.", "reviewRating": {"@type": "Rating", "worstRating": 1, "bestRating": 10, "ratingValue": 7}}, "aggregateRating": {"@type": "AggregateRating", "ratingCount": 2976, "bestRating": 10, "worstRating": 1, "ratingValue": 7.6}, "contentRating": "Not Rated", "genre": ["Documentary", "History"], "datePublished": "2010-03-03", "keywords": "shock doctrine,creative destruction,disaster capitalism,cia central intelligence agency,distraction", "trailer": {"@type": "VideoObject", "name": "The Shock Doctrine", "embedUrl": "/video/imdb/vi3815966489", "thumbnail": {"@type": "ImageObject", "contentUrl": "https://m.media-amazon.com/images/M/MV5BNDJhNDdjNzYtZGRkMi00OGE4LTkzNjctMzI5MzFjOTAyYjQ4XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg"}, "thumbnailUrl": "https://m.media-amazon.com/images/M/MV5BNDJhNDdjNzYtZGRkMi00OGE4LTkzNjctMzI5MzFjOTAyYjQ4XkEyXkFqcGdeQXVyNzU1NzE3NTg@._V1_.jpg", "description": "Trailer for this political documentary"}, "actor": [{"@type": "Person", "url": "/name/nm3773191/", "name": "Janine Huard"}, {"@type": "Person", "url": "/name/nm4541792/", "name": "Ewen Cameron"}, {"@type": "Person", "url": "/name/nm1468859/", "name": "Naomi Klein"}], "director": [{"@type": "Person", "url": "/name/nm1475971/", "name": "Mat Whitecross"}, {"@type": "Person", "url": "/name/nm0935863/", "name": "Michael Winterbottom"}], "creator": [{"@type": "Organization", "url": "/company/co0236169/"}, {"@type": "Organization", "url": "/company/co0103733/"}, {"@type": "Organization", "url": "/company/co0706824/"}, {"@type": "Person", "url": "/name/nm1468859/", "name": "Naomi Klein"}], "duration": "PT1H19M"}], "opengraph": [{"namespace": {"og": "http://ogp.me/ns#"}, "properties": [["og:url", "https://www.imdb.com/title/tt1355640/"], ["og:site_name", "IMDb"], ["og:title", "The Shock Doctrine (2009) - IMDb"], ["og:description", "The Shock Doctrine: Directed by Mat Whitecross, Michael Winterbottom. With Janine Huard, Ewen Cameron, Naomi Klein, Milton Friedman. An investigation of \"disaster capitalism\", based on Naomi Klein's proposition that neo-liberal capitalism feeds on natural disasters, war and terror to establish its dominance."], ["og:type", "video.movie"], ["og:image", "https://m.media-amazon.com/images/M/MV5BMjI4MTQwMDU0NV5BMl5BanBnXkFtZTgwMzEyMzA2MDE@._V1_FMjpg_UX1000_.jpg"], ["og:image:height", "1333.3333333333333"], ["og:image:width", "1000"], ["og:locale", "en_US"], ["og:locale:alternate", "es_ES"], ["og:locale:alternate", "es_MX"], ["og:locale:alternate", "fr_FR"], ["og:locale:alternate", "fr_CA"], ["og:locale:alternate", "it_IT"], ["og:locale:alternate", "pt_BR"], ["og:locale:alternate", "hi_IN"], ["og:locale:alternate", "de_DE"]]}]}}
